(3, 'return_policy_page', 'Refund and Returns', 'return-policy', '<h4 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Overview</span></h4><h4 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><img src=\"https://instamart.lk/public/uploads/all/SxoNRr6quhRdLPe2i8DqN3fO3EC9m8UgMDHpjTUs.webp\" style=\"width: 100%;\"><span style=\"font-weight: bolder;\"><br></span></h4><h3 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><p><a href=\"https://instamart.lk/wp-content/uploads/2022/08/returns.webp\"></a></p></h3><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Our refund and returns policy lasts 7 days. If 7 days have passed since your purchase, we canât offer you a full refund or exchange unless you have warranty on your purchase.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">To be eligible for a return, your item must be unused and in the same condition that you received it. It must also be in the original packaging.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Several types of goods are exempt from being returned. Perishable goods such as food, flowers, newspapers or magazines cannot be returned. We also do not accept products that are intimate or sanitary goods, hazardous materials, or flammable liquids or gases.<br>Additional non-returnable items:</h6><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"></h5><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><ul><li>Gift cards</li></ul><ul><li>Downloadable software products</li></ul><ul><li>Some health and personal care items</li></ul>To complete your return, we require a receipt or proof of purchase.<br>Please do not send your purchase back to the manufacturer.<br>There are certain situations where only partial refunds are granted:</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><ul><li>Book with obvious signs of use</li></ul><ul><li>CD, DVD, VHS tape, software, video game, cassette tape, or vinyl record that has been opened.</li></ul><ul><li>Any item not in its original condition, is damaged or missing parts for reasons not due to our error.</li></ul><ul><li>Any item that is returned more than 30 days after delivery</li></ul></h6><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Refunds</span></h5><h3 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"></h3><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Please contact us via any of our contact channels within seven days of delivery and we will ensure you get resolution.<br>Once your return is received and inspected, we will send you an email to notify you that we have received your returned item. We will also notify you of the approval or rejection of your refund.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><br>If you are approved, then your refund will be processed, and a credit will automatically be applied to your credit card or original method of payment, within a certain amount of days.</h6><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\"><br></span></h5><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Late or missing refunds</span></h5><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">If you havenât received a refund yet, first check your bank account again.<br>Then contact your credit card company, it may take some time before your refund is officially posted.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Next contact your bank. There is often some processing time before a refund is posted.<br>If youâve done all of this and you still have not received your refund yet, please contact us at returns@instamart.lk .</h6><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><br></p><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Sale items</span></h5><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Only regular priced items may be refunded. Sale items cannot be refunded.</h6><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><br></p><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Exchanges</span></h5><h3 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"></h3><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">We only replace items if they are defective or damaged. If you need to exchange it for the same item, send us an email at returns@instamart.lk and send your item to: 192/1A, matagoda road, kerawalapitiya, wattala.</h6><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder; font-size: 1.25rem;\"><br></span></p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder; font-size: 1.25rem;\">Gifts</span><br></p><h3 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"></h3><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">If the item was marked as a gift when purchased and shipped directly to you, youâll receive a gift credit for the value of your return. Once the returned item is received, a gift certificate will be mailed to you.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">If the item wasnât marked as a gift when purchased, or the gift giver had the order shipped to themselves to give to you later, we will send a refund to the gift giver and they will find out about your return.</h6><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><br></p><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Shipping returns</span></h5><h3 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"></h3><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">To return your product, you should mail your product to: 192/1A, matagoda road, kerawalapitiya, wattala.<br>You will be responsible for paying for your own shipping costs for returning your item. Shipping costs are non-refundable. If you receive a refund, the cost of return shipping will be deducted from your refund.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Depending on where you live, the time it may take for your exchanged product to reach you may vary.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">If you are returning more expensive items, you may consider using a trackable shipping service or purchasing shipping insurance. We donât guarantee that we will receive your returned item.</h6><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><br></p><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Need help?</span></h5><h3 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"></h3><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Contact us at returns@instamart.lk for questions related to refunds and returns.</h6>', 'Refund and Returns', NULL, NULL, NULL, '2020-11-04 10:14:41', '2023-01-19 17:12:53'),
(4, 'support_policy_page', 'Support Policy Page', 'support-policy', NULL, NULL, NULL, NULL, NULL, '2020-11-04 10:14:59', '2020-11-04 10:14:59');
