are communicating with us electronically. You will be required to provide a valid phone number while placing an order with us. We may communicate with you by e-mail, SMS, phone call or by posting notices on the Site or by any other mode of communication we choose to employ. For contractual purposes, you consent to receive communications (including transactional, promotional and/or commercial messages), from us with respect to your use of the website (and/or placement of your order) and agree to treat all modes of communication with the same importance.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">O. LOSSES</span><br>We will not be responsible for any business or personal losses (including but not limited to loss of profits, revenue, contracts, anticipated savings, data, goodwill, or wasted expenditure) or any other indirect or consequential loss that is not reasonably foreseeable to both you and us when you commenced using the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">P. AMENDMENTS TO CONDITIONS OR ALTERATIONS OF SERVICE AND RELATED PROMISE</span><br>We reserve the right to make changes to the Site, its policies, these terms and conditions and any other publicly displayed condition or service promise at any time. You will be subject to the policies and terms and conditions in force at the time you used the Site unless any change to those policies or these conditions is required to be made by law or government authority (in which case it will apply to orders previously placed by you). If any of these conditions is deemed invalid, void, or for any reason unenforceable, that condition will be deemed severable and will not affect the validity and enforceability of any remaining condition.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">Q. EVENTS BEYOND OUR CONTROL</span><br>We will not be held responsible for any delay or failure to comply with our obligations under these conditions if the delay or failure arises from any cause which is beyond our reasonable control. This condition does not affect your statutory rights.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">R. WAIVER</span><br>You acknowledge and recognize that we are a private commercial enterprise and reserve the right to conduct business to achieve our objectives in a manner we deem fit. You also acknowledge that if you breach the conditions stated on our Site and we take no action, we are still entitled to use our rights and remedies in any other situation where you breach these conditions.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">S. TERMINATION</span><br>In addition to any other legal or equitable remedies, we may, without prior notice to you, immediately terminate the Terms and Conditions or revoke any or all of your rights granted under the Terms and Conditions. Upon any termination of this Agreement, you shall immediately cease all access to and use of the Site and we shall, in addition to any other legal or equitable remedies, immediately revoke all password(s) and account identification issued to you and deny your access to and use of this Site in whole or in part. Any termination of this agreement shall not affect the respective rights and obligations (including without limitation, payment obligations) of the parties arising before the date of termination. You furthermore agree that the Site shall not be liable to you or to any other person as a result of any such suspension or termination. If you are dissatisfied with the Site or with any terms, conditions, rules, policies, guidelines, or practices in operating the Site, your sole and exclusive remedy is to discontinue using the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">T. GOVERNING LAW AND JURISDICTION</span><br>These terms and conditions are governed by and construed in accordance with the laws of The Democratic Socialist Republic of Sri Lanka. You agree, as we do, to submit to the exclusive jurisdiction of the courts, of Sri Lanka having jurisdiction over the place on which our Registered Office is situated at the time of institution of legal proceedings.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">U. CONTACT US</span><br>You may reach us here</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">V. OUR SOFTWARE</span><br>Our software includes any software (including any updates or upgrades to the software and any related documentation) that we make available to you from time to time for your use in connection with the Site (the \"Software\").</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">You may use the software solely for purposes of enabling you to use and enjoy our services as permitted by the Terms and Conditions and any related applicable terms as available on the Site. You may not incorporate any portion of the Software into your own programs or compile any portion of it in combination with your own programs, transfer it for use with another service, or sell, rent, lease, lend, loan, distribute or sub-license the Software or otherwise assign any rights to the Software in whole or in part. You may not use the Software for any illegal purpose. We may cease providing you service and we may terminate your right to use the Software at any time. Your rights to use the Software will automatically terminate without notice from us if you fail to comply with any of the Terms and Conditions listed here or across the Site. Additional third-party terms contained within the Site or distributed as such that are specifically identified in related documentation may apply and will govern the use of such software in the event of a conflict with these Terms and Conditions. All software used in any of our services is our property and/or our affiliates or its software suppliers and protected by the laws of Sri Lanka including but not limited to any other applicable copyright laws.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">When you use the Site, you may also be using the services of one or more third parties, such as a wireless carrier or a mobile platform provider. Your use of these third party services may be subject to separate policies, terms of use, and fees of these third parties.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">You may not, and you will not encourage, assist or authorize any other person to copy, modify, reverse engineer, decompile or disassemble, or otherwise tamper with our software whether in whole or in part, or create any derivative works from or of the Software.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">In order to keep the Software up-to-date, we may offer automatic or manual updates at any time and without notice to you.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">3. CONDITIONS OF SALE (BETWEEN SELLERS AND CUSTOMERS)</span><br>Please read these conditions carefully before placing an order for any products with the Sellers on the Site. These conditions signify your agreement to be bound by these conditions.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">A. CONDITIONS RELATED TO SALE OF THE PRODUCT OR SERVICE</span><br>This section deals with conditions relating to the sale of products or services on the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">B. THE CONTRACT</span><br>Your order is a legal offer to the seller to buy the product or service displayed on our Site. When you place an order to purchase a product, any confirmations or status updates received prior to the dispatch of your order serves purely to validate the order details provided and in no way implies the confirmation of the order itself. The acceptance of your order is considered confirmed when the product is dispatched to you. If your order is dispatched in more than one package, you may receive separate dispatch confirmations. Upon time of placing the order, we indicate an approximate timeline that the processing of your order will take however we cannot guarantee this timeline to be rigorously precise in every instance as we are dependent on third party service providers to preserve this commitment. We commit to you to make every reasonable effort to ensure that the indicative timeline is met. All commercial/contractual terms are offered by and agreed to between you and the sellers alone. The commercial/contractual terms include without limitation price, shipping costs, payment methods, payment terms, date, period and mode of delivery, warranties related to products and services and after sales services related to products and services. instamart.lk does not have any control or does not determine or advise or in any way involve itself in the offering or acceptance of such commercial/contractual terms between the you and the Sellers. The seller retains the right to cancel any order at its sole discretion prior to dispatch. We will ensure that there is timely intimation to you of such cancellation via an email or sms. Any prepayments made in case of such cancellation(s), shall be refunded to you within the time frames stipulated here.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">You confirm that the product(s) or service(s) ordered by you are purchased for your internal / personal consumption and not for commercial re-sale. You authorize us to declare and provide declaration to any governmental authority on your behalf stating the aforesaid purpose for your orders on the Site. The Seller or the Site may cancel an order wherein the quantities exceed the typical individual consumption. This applies both to the number of products ordered within a single order and the placing of several orders for the same product where the individual orders comprise a quantity that exceeds the typical individual consumption. What comprises a typical individual\'s consumption quantity limit shall be based on various factors and at the sole discretion of the Seller or ours and may vary from individual to individual.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">You may cancel your order at no cost any time before the item is dispatched to you.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Please note that we sell products only in quantities which correspond to the typical needs of an average household. This applies both to the number of products ordered within a single order and the placing of several orders for the same product where the individual orders comprise a quantity typical for a normal household.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">C. RETURNS</span><br>Please review our Return Policy for details.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">D. PRICING, AVAILABILITY AND ORDER PROCESSING</span><br>All prices are listed in Rupees and are inclusive of all applicable taxes and are listed on the Site by the seller that is selling the product or service (if you need you can convert it to USD in any time with the currency changing option) . Items in your Shopping Cart will always reflect the most recent price displayed on the item\'s product detail page. Please note that this price may differ from the price shown for the item when you first placed it in your cart. Placing an item in your cart does not reserve the price shown at that time. It is also possible that an item\'s price may decrease between the time you place it in your basket and the time you purchase it.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We do not offer price matching for any items sold by any seller on our Site or other websites.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We are determined to provide the most accurate pricing information on the Site to our users; however, errors may still occur, such as cases when the price of an item is not displayed correctly on the Site. As such, we reserve the right to refuse or cancel any order. In the event that an item is mispriced, we may, at our own discretion, either contact you for instructions or cancel your order and notify you of such cancellation. We shall have the right to refuse or cancel any such orders whether or not the order has been confirmed and your prepayment processed. If such a cancellation occurs on your prepaid order, our policies for refund will apply.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We list availability information for products listed on the Site, including on each product information page. Beyond what we say on that page or otherwise on the Site, we cannot be more specific about availability. Please note that dispatch estimates are just that. They are not guaranteed dispatch times and should not be relied upon as such. As we process your order, you will be informed by e-mail or sms if any products you order turn out to be unavailable.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Please note that there are cases when an order cannot be processed for various reasons. The Site reserves the right to refuse or cancel any order for any reason at any given time. You may be asked to provide additional verifications or information, including but not limited to phone number and address, before we accept the order.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">In order to avoid any fraud with credit or debit cards, we reserve the right to obtain validation of your payment details before providing you with the product and to verify the personal information you shared with us. This verification can take the shape of an identity, place of residence, or banking information check. The absence of an answer following such an inquiry will automatically cause the cancellation of the order within a reasonable timeline. We reserve the right to proceed to direct cancellation of an order for which we suspect a risk of fraudulent use of banking instruments or other reasons without prior notice or any subsequent legal liability.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Refund Voucher<br>Refund voucher can be redeemed on our Website, as full or part payment of products from our Website within the given timeline.<br>Refund voucher cannot be used from different account.<br>Vouchers are not replaceable if expired.<br>Promotional Vouchers<br>Each issued promotional voucher (App voucher and New customer voucher) will be valid for use by a customer only once. Multiple usages changing the identity is illegal.<br>Promotional voucher is non-refundable and cannot be exchanged for cash in part or full and is valid for a single transaction only.<br>Promotional voucher may not be valid during sale or in conjunction with any special promotion.<br>Voucher will work only if minimum purchase amount and other conditions are met.<br>instamart.lk reserves the right to vary or terminate the operation of any voucher at any time without notice.<br>instamart.lk shall not be liable to any customer or household for any financial loss arising out of the refusal, cancellation or withdrawal of any voucher or any failure or inability of a customer to use a voucher for any reason.<br>Vouchers are not replaceable if expired.<br>Security and Fraud<br>When you use a voucher, you warrant to instamart.lk that you are the duly authorized recipient of the voucher and that you are using it in good faith.<br>If you redeem, attempt to redeem or encourage the redemption of voucher to obtain discounts to which you are not entitled you may be committing a civil or criminal offence.<br>If we reasonably believe that any voucher is being used unlawfully or illegally we may reject or cancel any voucher/order and you agree that you will have no claim against us in respect of any rejection or cancellation. instamart.lk reserves the right to take any further action it deems appropriate in such instances</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">E. RESELLING DARAZ PRODUCTS</span><br>Reselling instamart.lk products for business purpose is strictly prohibited. If any unauthorized personnel is found committing the above act, legal action may be taken against him/her.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">F. TAXES</span><br>You shall be responsible for payment of all fees/costs/charges associated with the purchase of products from the Site and you agree to bear any and all applicable taxes as per prevailing law.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">l. REPRESENTATIONS AND WARRANTIES</span><br>We do not make any representation or warranty as to specifics (such as quality, value, saleability, etc) of the products or services listed to be sold on the Site when products or services are sold by third parties. We do not implicitly or explicitly support or endorse the sale or purchase of any products or services on the Site. We accept no liability for any errors or omissions, whether on behalf of itself or third parties.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We are not responsible for any non-performance or breach of any contract entered into between you and the sellers. We cannot and do not guarantee your actions or those of the sellers as they conclude transactions on the Site. We are not required to mediate or resolve any dispute or disagreement arising from transactions occurring on our Site.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We do not at any point of time during any transaction as entered into by you with a third party on our Site, gain title to or have any rights or claims over the products or services offered by a seller. Therefore, we do not have any obligations or liabilities in respect of such contract(s) entered into between you and the seller(s). We are not responsible for unsatisfactory or delayed performance of services or damages or delays as a result of products which are out of stock, unavailable or back ordered.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Pricing on any product(s) or related information as reflected on the Site may due to some technical issue, typographical error or other reason by incorrect as published and as a result you accept that in such conditions the seller or the Site may cancel your order without prior notice or any liability arising as a result. Any prepayments made for such orders will be refunded to you per our refund policy as stipulated.</p>', 'Terms and Conditions', NULL, 'Terms and Conditions, Terms', NULL, '2020-11-04 10:15:29', '2023-01-19 17:56:15');
INSERT INTO `pages` (`id`, `type`, `title`, `slug`, `content`, `meta_title`, `meta_description`, `keywords`, `meta_image`, `created_at`, `updated_at`) VALUES
(6, 'privacy_policy_page', 'Privacy Policy Page', 'privacy-policy', '<p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><img src=\"https://instamart.lk/public/uploads/all/WWzglJUKPOPypXIiBb7w1nGMkwKTeYsi8Q3KI8Xy.webp\" style=\"width: 100%;\"><br></p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">Welcome to the instamart.lk website (the \"Site\") operated by instamart groups (Private) Limited, We respect your privacy and want to protect your personal information. To learn more, please read this Privacy Policy.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">1.</span>This Privacy Policy explains how we collect, use and (under certain conditions) disclose your personal information. This Privacy Policy also explains the steps we have taken to secure your personal information. Finally, this Privacy Policy explains your options regarding the collection, use and disclosure of your personal information. By visiting the Site directly or through another site, you accept the practices described in this Policy.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">2.</span>Data protection is a matter of trust and your privacy is important to us. We shall therefore only use your name and other information which relates to you in the manner set out in this Privacy Policy. We will only collect information where it is necessary for us to do so and we will only collect information if it is relevant to our dealings with you.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">3.</span>We will only keep your information for as long as we are either required to by law or as is relevant for the purposes for which it was collected.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">4.</span>We will cease to retain your personal data, or remove the means by which the data can be associated with you, as soon as it is reasonable to assume that such retention no longer serves the purposes for which the personal data was collected, and is no longer necessary for any legal or business purpose.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">5.</span>You can visit the Site and browse without having to provide personal details. During your visit to the Site you remain anonymous and at no time can we identify you unless you have an account on the Site and log on with your user name and password.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.</span>Data that we collect</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.1</span>We may collect various pieces of information if you seek to place an order for a product with us on the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.2</span>We collect, store and process your data for processing your purchase on the Site and any possible later claims, and to provide you with our services. We may collect personal information including, but not limited to, your title, name, gender, date of birth, email address, postal address, delivery address (if different), telephone number, mobile number, fax number, payment details, payment card details or bank account details.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.2.1</span>Instamart.lk shall collect the following information where you are a buyer:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">i.</span>&nbsp;Identity data, such as your name, gender, profile picture, and date of birth;&nbsp;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">ii.</span>&nbsp;Contact data, such as billing address, delivery address/location, email address and phone numbers;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">iii.</span>&nbsp;Biometric data, such as voice files and face recognition when you use our voice search function, and your facial features of when you use the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">iv.</span>&nbsp;Billing account information: bank account details, credit card account and payment information (such account data may also be collected directly by our affiliates&nbsp;&nbsp;and/or third party payment service providers);</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">v.</span>&nbsp;Transaction records/data, such as details about orders and payments, user clicks, and other details of products and Services related to you;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">vi.</span>&nbsp;Technical data, such as Internet protocol (IP) address, your login data, browser type and version, time zone setting and location, device information, browser plug-in&nbsp;&nbsp;type and versions, operating system and platform, international mobile equipment identity, device identifier, IMEI, MAC address, cookies (where applicable) and other information and technology on the devices you use to access the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">vii.</span>&nbsp;Profile data, such as your username and password, account settings, orders related to you, user research, your interests, preferences, feedback and survey responses;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">viii.</span>&nbsp;Usage data, such as information on how you use the Site, products and Services or view any content on the Site, including the time spent on the Site, items and data searched for on the Site, access times and dates, as well as websites you were visiting before you came to the Site and other similar statistics;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">ix.</span>&nbsp;Location data, such as when you capture and share your location with us in the form of photographs or videos and upload such content to the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">x.</span>&nbsp;Marketing and communications data, such as your preferences in receiving marketing from us and our third parties, your communication preferences and your chat, email or call history on the Site or with third party customer service providers; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">xi.</span>&nbsp;Additional information we may request you to submit for due diligence checks or required by relevant authorities as required for identity verification (such as copies of government issued identification, e.g. passport, ID cards, etc.) or if we believe you are violating our Privacy Policy or our Customer Terms and Conditions.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.2.2.</span>Instamart.lk shall collect the following information where you are a seller:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">i.</span>&nbsp;Identity and contact data, such as your name, date of birth or incorporation, company name, address, email address, phone number and other business-related information (e.g. company registration number, business license, tax information, shareholder and director information, etc.);</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">ii.</span>&nbsp;Account data, such as bank account details, bank statements, credit card details and payment details (such account data may also be collected directly by our affiliates and/or third party payment service providers);</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">iii.</span>&nbsp;Transaction data, such as details about orders and payments, and other details of products and Services related to you;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">iv.</span>&nbsp;Technical data, such as Internet protocol (IP) address, your login data, browser type and version, time zone setting and location, browser plug-in types and versions, operating system and platform, international mobile equipment identity, device identifier, IMEI, MAC address, cookies (where applicable) and other information and technology on the devices you use to access the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">v.</span>&nbsp;Profile data, such as your username and password, orders related to you, your interests, preferences, feedback and survey responses;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">vi.</span>&nbsp;Usage data, such as information on how you use the Site, products and Services or view any content on the Site, including the time spent on the Site, items and data searched for on the Site, access times and dates, as well as websites you were visiting before you came to the Site and other similar statistics;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">vii.</span>&nbsp;Location data, such as when you capture and share your location with us in the form of photographs or videos and upload such content to the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">viii.</span>&nbsp;Marketing and communications data, such as your preferences in receiving marketing from us and our third parties and your communication preferences and your chat, email or call history on the Site or with our third party seller service providers; and&nbsp;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">ix.</span>&nbsp;Additional information we may request you to submit for authentication (such as copies of government issued identification, e.g. passport, ID cards, etc.) or if we believe you are violating our Privacy Policy or our Terms of Use.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><s