: 13px;\"><span style=\"font-weight: bolder;\">6.3.1.2.</span>&nbsp;Providing services</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. Facilitate your use of the services or access to the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. Administer your account with us;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. Display your name, username or profile on the Site (including on any reviews you may post);</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iv. Respond to your queries, feedback, claims or disputes, whether directly or through our third party service providers; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">v. Display on scoreboards on the Site in relation to campaigns, mobile games or any other activity;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.1.3.</span>&nbsp;Marketing and advertising:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. Provide you with information we think you may find useful or which you have requested from us (provided you have opted to receive such information);</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. Send you marketing or promotional information about \\ products and services on the Site from time to time (provided you have opted to receive such information); and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. Help us conduct marketing and advertising;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-