or: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. Conduct automated decision-making processes in accordance with any of the above purposes.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.2.</span>&nbsp;If you are a seller:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.2.1.</span>&nbsp;Providing Services</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. To facilitate your use of the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. To ship or deliver the products you have listed or sold through the Site. We may pass your personal information on to a third party (e.g. our logistics partners) or relevant regulatory authority (e.g. customs) in order to carry out shipping or delivery of the products listed or sold by you;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. To respond to your queries, feedback, claims or disputes, whether directly or through our third party service agents;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iv. To verify your documentation submitted to us facilitate your onboarding with us as a seller on the Site, including the testing of technologies to enable faster and more efficient onboarding;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">v. To administer your account (if any) with us;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vi. To display your name, username or profile on the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vii. To verify and carry out financial transactions (including any credit card payments, bank transfers, offline payments, remittances, or e-wallet transactions) in relation to payments related to you and/or Services used by you. In order to verify and carry out such payment transactions, payment information, which may include personal data, will be transferred to third parties such as our payment service providers;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">viii. To assess your application for loan facilities and/or to perform credit risk assessments in relation to your application for seller financing (where applicable);</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ix. To provide you with ancillary logistics services to protect against risks of failed deliveries or customer returns; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">x. To facilitate the return of products to you (which may be through our logistics partner).</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.2.2.</span>&nbsp;Marketing and advertising</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. To send you marketing or promotional materials about our or third-party sellersâ products and services on our Site from time to time (provided you have opted to receive such information); and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. To help us conduct marketing and advertising.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.2.3.</span>&nbsp;Legal and operational purposes