ns-serif; font-size: 13px;\">ix. To facilitate the takedown of prohibited and controlled items from our Site.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.2.4.</span>&nbsp;Analytics, research, business and development</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. To audit the downloading of data from the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. To understand the user experience with the Services and the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. To improve the layout or content of the pages of the Site and customize them for users;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iv. To conduct surveys, including carrying out research on our usersâ demographics and behavior to improve our current technology (e.g. voice recognition tech, etc.) via machine learning or other means;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">v. To derive further attributes relating to you based on personal data provided by you (whether to us or third parties), in order to provide you with more targeted and/or relevant information;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vi. To conduct data analysis, testing and research, monitoring and analyzing usage and activity trends;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vii. To further develop our products and services; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">viii. To know our sellers better.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.2.5.</span>&nbsp;Other</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. Any other purpose to which your consent has been obtained; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. To conduct automated decision-making processes in accordance with any of these purposes.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.4.</span>&nbsp;Further, we will use the information you provide to administer your account with us; verify and carry out financial transactions in relation to payments you make; audit the downloading of data from our website; improve the layout and/or content of the pages of our website and customize them for users; identify visitors on our website; carry out research on our users\' demographics; send you information we think you may find useful or which you have requested from us, including information about our products and services, provided you have indicated that you have not objected to being contacted for these purposes.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.5.</span>&nbsp;Subject to obtaining your consent we may contact you by email with details of other products and services. You may unsubscribe from receiving marketing information at any time in our mobile application settings or by using the unsubscribe function within the electronic marketing material. We may use your contact information to send newsletters from us and from our related companies. If you prefer not to receive any marketing communications from us, you can opt out at any time.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.6.</span>&nbsp;We may pass your name and address on to a third party in order to make delivery of the product to you (for example to our courier or supplier). You must only submit to us the Site information which is accurate and not misleading and you must keep it up to date and are responsible for informing us of changes to your personal data, or in the event you believe that the personal data we have about you is inaccurate, incomplete, misleading or out of date. Inform us of changes. You can update your personal data anytime by accessing your account on the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.7.</span>&nbsp;Your actual order details may be stored with us but for security reasons cannot be retrieved directly by us. However, you may access this information by logging into your account on the Site. Here you can view the details of your orders that have been completed, those which are open and those which are shortly to be dispatched and administer your address details, bank details ( for refund purposes) and any newsletter to which you may have subscribed. You undertake to treat the personal access data confidentially and not make it available to unauthorized third parties. We cannot assume any liability for misuse of passwords unless this misuse is our fault.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">7.&nbsp;</span>Other uses of your Personal Information</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">7.1.</span>&nbsp;We may use your personal information for opinion and market research. Your details are anonymous and will only be used for statistical purposes. You can choose to opt out of this at any time. Any answers to surveys or opinion polls we may ask you to complete will not be forwarded on to third parties. Disclosing your email address is only necessary if you would like to take part in competitions. We save the answers to our surveys separately from your email address.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">7.2.</span>&nbsp;We may also send you other information about us, the Site, our other websites, our products, sales promotions, our newsletters, anything relating to other companies in our group or our business partners. If you would prefer not to receive any of this additional information as detailed in this paragraph (or any part of it) please click the \'unsubscribe\' link in any email that we send to you. Within 7 working days (days which are neither (i) a Sunday, nor (ii) a public holiday anywhere in Sri Lanka) of receipt of your instruction we will cease to send you information as requested. If your instruction is unclear we will contact you for clarification.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">7.3.</span>&nbsp;We may further anonymize data about users of the Site generally and use it for various purposes, including ascertaining the general location of the users and usage of certain aspects of the Site or a link contained in an email to those registered to receive them, and supplying that anonymized data to third parties such as publishers. However, that anonymized data will not be capable of identifying you personally.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">8.</span>&nbsp;Competitions</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">8.1.</span>&nbsp;For any competition we use the data to notify winners and advertise our offers. You can find more details where applicable in our participation terms for the respective competition.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.</span>&nbsp;Third Parties and Links</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.1.</span>&nbsp;We may pass your details to other companies in our group. We may also pass your details to our agents and subcontractors to help us with any of our uses of your data set out in our Privacy Policy. For example, we may use third parties to assist us with delivering products to you, to help us to collect payments from you, to analyze data and to provide us with marketing or customer service assistance. We may also exchange information with third parties for the purposes of fraud protection and credit risk reduction.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.2.</span>&nbsp;We may share (or permit the sharing of) your personal data with and/or transfer your personal data to third parties and/or our affiliates for the above-mentioned purposes. These third parties and affiliates, which may be located inside or outside your jurisdiction, include but are not limited to:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. Service providers (such as agents, vendors, contractors and partners) in areas such as payment services, logistics and shipping, marketing, data analytics, market or consumer research, survey, social media, customer service, installation services, information technology and website hosting;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. Their service providers and related companies; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. Other users of the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.3.</span>&nbsp;We may transfer our databases containing your personal information if we sell our business or part of it, provided that we satisfy the requirements of applicable data protection law when disclosing your personal data. Other than as set out in this Privacy Policy, we shall NOT sell or disclose your personal data to third parties without obtaining your prior consent unless this is necessary for the purposes set out in this Privacy Policy or unless we are required to do so by law. The Site may contain advertising of third parties and links to other sites or frames of other sites. Please be aware that we are not responsible for the privacy practices or content of those third parties or other sites, nor for any third party to whom we transfer your data in accordance with our Privacy Policy. You are advised to check on the applicable privacy policies of those websites to determine how they will handle any information they collect from you.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.4.</span>&nbsp;In disclosing your personal data to third parties, we endeavor to ensure that the third parties and our affiliates keep your personal data secure from unauthorized access, collection, use, disclosure, processing or similar risks and retain your personal data only for as long as your personal data helps with any of the uses of your data as set out in our Privacy Policy.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.5.</span>&nbsp;We may transfer or permit the transfer of your personal data outside of Sri Lanka for any of the purposes set out in this Privacy Policy. However, we will not transfer or permit any of your personal data to be transferred outside of Sri Lanka unless the transfer is in compliance with applicable laws and this Privacy Policy.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.6.</span>&nbsp;We may share your personal data with our third party service providers or affiliates (e.g. payment service providers) in order for them to offer services to you other than those related to your use of the Site. Your acceptance and use of the third party service providerâs or our affiliateâs services shall be subject to terms and conditions as may be agreed between you and the third party service provider or our affiliate. Upon your acceptance of the third party service providerâs or our affiliateâs service offering, the collection, use, disclosure, storage, transfer and processing of your data (including your personal data and any data disclosed by us to such third party service provider or affiliate) shall be subject to the applicable privacy policy of the third party service provider or our affiliate, which shall be the data controller of such data. You agree that any queries or complaints relating to your acceptance or use of the third party service providerâs or our affiliateâs services shall be directed to the party named in the applicable privacy policy.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">10.</span>&nbsp;Cookies</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">10.1.</span>&nbsp;We or our authorized service providers may use cookies, web beacons, and other similar technologies in connection with your use of the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">10.2.</span>&nbsp;The acceptance of cookies is not a requirement for visiting the Site. However, we would like to point out that the use of the \'basket\' functionality on the Site and ordering is only possible with the activation of cookies. Cookies are small text files (typically made up of letters and numbers) placed in the memory of your browser or device when you visit a website or view a message. They allow us to recognize a particular device or browser. Web beacons are small graphic images that may be included on the Site. They allow us to count users who have viewed these pages so that we can better understand your preference and interests. Cookies are tiny text files which identify your computer to our server as a unique user when you visit certain pages on the Site and they are stored by your Internet browser on your computer\'s hard drive. Cookies can be used to recognize your Internet Protocol address, saving you time while you are on, or want to enter, the Site. We only use cookies for your convenience in using the Site (for example to remember who you are when you want to amend your shopping cart without having to re-enter your email address) and not for obtaining or using any other information about you (for example targeted advertising). However, certain cookies are required to enable core functionality (such as adding items to your shopping basket), so please note that changing and deleting cookies may affect the functionality available on the Sit. Your browser can be set to not accept cookies, but this would restrict your use of the Site. Please accept our assurance that our use of cookies does not contain any personal or private details and are free from viruses. If you want to find out more information about cookies, go to&nbsp;<a href=\"https://policies.google.com/technologies/cookies?hl=en-US\">all-about-cookies</a>&nbsp;or to find out about removing them from your browser, go to&nbsp;<a href=\"chrome://settings/cookies\">here</a>.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">10.3.</span>&nbsp;This website uses Google Analytics, a web analytics service provided by Google, Inc. (\"Google\"). Google Analytics uses cookies, which are text files placed on your computer, to help the website analyze how users use the site. The information generated by the cookie about your use of the website (including your IP address) will be transmitted to and stored by Google on servers in the United States. Google will use this information for the purpose of evaluating your use of the website, compiling reports on website activity for website operators and providing other services relating to website activity and internet usage. Google may also transfer this information to third parties where required to do so by law, or where such third parties process the information on Google\'s behalf. Google will not associate your IP address with any other data held by Google. You may refuse the use of cookies by selecting the appropriate settings on your browser, however please note that if you do this you may not be able to use the full functionality of this website. By using this website, you consent to the processing of data about you by Google in the manner and for the purposes set out above.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">11.</span>&nbsp;Security</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">11.1.</span>&nbsp;We have in place appropriate technical and security measures to prevent unauthorized or unlawful access to or accidental loss of or destruction or damage to your information. When we collect data through the Site, we collect your personal details on a secure server. We use firewalls on our servers. Our security procedures mean that we may occasionally request proof of identity before we disclose personal information to you. You are responsible for protecting against unauthorized access to your password and to your computer.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">11.2.</span>&nbsp;You should be aware, however, that no method of transmission over the Internet or method of electronic storage is completely secure. While security cannot be guaranteed, we strive to protect the security of your information and are constantly reviewing and enhancing our information security measures.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">12.</span>&nbsp;Your rights</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">12.1.</span>&nbsp;If you are concerned about your data, you have the right to request access to the personal data which we may hold or process about you. You have the right to require us to correct any inaccuracies in your data free of charge. At any stage you also have the right to ask us to stop using your personal data for direct marketing purposes.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">Where permitted by applicable data protection laws, we reserve the right to charge a reasonable administrative fee for retrieving your personal data records. If so, we will inform you of the fee before processing your request.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">You may communicate the withdrawal of your consent to the continued use, disclosure, storing and/or processing of your personal data by contacting our customer services, subject to the conditions and/or limitations imposed by applicable laws or regulations. Please note that if you communicate your withdrawal of your consent to our use, disclosure, storing or processing of your personal data for the purposes and in the manner as stated above or exercise your other rights as available under applicable local laws, we may not be in a position to continue to provide the Services to you or perform any contract we have with you, and we will not be liable in the event that we do not continue to provide the Services to, or perform our contract with you. Our legal rights and remedies are expressly reserved in such an event.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">Furthermore, you also have the right to ask us to delete your data. If you would like to have your data deleted, fill out the&nbsp;<a href=\"https://active.instamart.lk/privacy-policy#\">Account Deactivation/Deletion Request Form</a>&nbsp;(âDeletion Requestâ) or email your request to&nbsp;info@instamart.lk. Once your request is received, we follow an internal deletion process to make sure that your data is safely removed in the next fifteen (15) working days. You\'ll be contacted for verification and your account will be deleted after necessary protocols are conformed to. Read more about the deletion process&nbsp;<a href=\"https://active.instamart.lk/privacy-policy#\">here</a>.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">13.</span>&nbsp;Minors</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">13.1.</span>&nbsp;We do not sell products to minors, i.e. individuals below the age of 18, on the Site and we do not knowingly collect any personal data relating to minors. You hereby confirm and warrant that you are above the age of 18 and are capable of understanding and accepting the terms of this Privacy Policy.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">13.2.</span>&nbsp;If you allow a minor to access the Site and buy products from the Site by using your account, you hereby consent to the processing of the minorâs personal data and accept and agree to be bound by this Privacy Policy and take responsibility for his or her actions.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"></p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">13.3.</span>&nbsp;We will not be responsible for any unauthorized use of your account on the Site by yourself, users who act on your behalf or any unauthorized users. It is your responsibility to make your own informed decisions about the use of the Site and take necessary steps to prevent any misuse of the Site.</p>', NULL, NULL, NULL, NULL, '2020-11-04 10:15:55', '2023-01-19 17:48:10'),
