(9, 'custom_page', 'Donations', 'donations', '<p><img src=\"https://instamart.lk/public/uploads/all/fp9dmBLL60AjRPGRSsOUS4L35H4ohLkUzjzpgzK3.webp\" style=\"width: 100%;\"><img src=\"https://instamart.lk/public/uploads/all/93z5GTzHp77bLkNudCZnD8ZLZVpKv2hYribG4OsC.webp\" style=\"width: 100%;\"><br></p>', 'Donations', 'Donations', 'Donations', NULL, '2023-01-18 17:59:17', '2023-01-18 18:00:22'),
(10, 'custom_page', 'About INSTAMART.LK', 'aboutus', '<h6><img src=\"https://instamart.lk/public/uploads/all/mK9mAg9Pr86xv5DMvDzjxmpkDsjAehqlDGhS9bPo.png\" style=\"width: 50%;\"><br></h6><h6><br></h6><h6>Instamart.lk is 100% Sri Lanka origin largest online Shopping website. We launched in June 2022 and our mission is to become the engine of commerce and trade in Sri Lanka.</h6><h5><span style=\"font-size: 1rem;\">We serve a retail customer base that continues to grow exponentially, offering products that span various categories including Phones, Computers, Clothing, Shoes, Home Appliances, Books, healthcare, Baby Products, personal care and much more.</span><br></h5><h6>Our range of services are designed to ensure optimum levels of convenience and customer satisfaction with the retail process; these services include our lowest price guarantee, 7-day free return policy*, order delivery-tracking, dedicated customer service support and many other premium services.</h6><h6>As we continue to expand the mall, our scope of offerings will increase in variety, simplicity and convenience; join us and enjoy the increasing benefits.</h6><h6>We are highly customer-centric and are committed towards finding innovative ways of improving our customers\' shopping experience with us; so give us some feedback or any press related questions, kindly send us an email on info@instamart.lk.&nbsp;&nbsp;</h6><h5><br></h5><h6>Thank you and we hope you enjoy your experience with us.<br>Best Regards</h6><p><br style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"></p>', 'About Instamart.lk', NULL, NULL, NULL, '2023-01-19 16:33:23', '2023-01-19 16:35:43'),
(11, 'custom_page', 'Shipping & Delivery', 'shippingdelivery', '<h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><img src=\"https://instamart.lk/public/uploads/all/PvhMsQQ2CP9YLWig2luGlniMNQdgy8sEZf1XIVNn.jpg\" style=\"width: 100%;\"><span style=\"font-weight: bolder;\"><br></span></h5><h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><span style=\"font-weight: bolder; font-size: 1.25rem;\"><br></span></h5><h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><span style=\"font-weight: bolder; font-size: 1.25rem;\">Are All Items Purchased Online Covered By Warranty?</span><br></h5><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 1rem;\">Products sold directly by instamart.lk are purchased from authorized distributors. Some of the devices are covered under a manufacturer warranty.</span><br></p><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\">We also offer a standard 7 day return policy for eligible items in case you need to make a return.</h6><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\">To return any items bought on instamart.lk, ensure the item is in line with the conditions in the Return Policy.</h6><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><br></p><h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><span style=\"font-weight: bolder;\">How Will The Delivery Be Done?</span></h5><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 1rem;\">We process most of our deliveries through Instamart.lk Delivery Courier. As a marketplace, our featured sellers have the option of making deliveries via other reputable couriers or delivering your order to you themselves.</span><br></p><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 1rem;\"><br></span></p><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 1rem;\">We recommend you pre-pay to instamart.lk (via InstaPay, ATM cards or cash deposit/transfer) for your order in order to take advantage of our Buyer Protection Program.</span><br></p><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 1rem;\"><br></span></p><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 1rem;\">Read more here process most of our deliveries through instamart.lk dispatches.</span><br></p><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><br>Some deliveries may be processed through reputed couriers (there is no added cost to this).</h6><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 24px;\"><br></span></p><h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><span style=\"font-weight: bolder;\">What Is The Estimated Delivery Time?</span></h5><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\">Standard delivery time is 7 days however, this may vary by location and even product.</h6><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><br>Delivery time for products are usually indicated on the product detail page.</h6><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 24px;\"><br></span></p><h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><span style=\"font-weight: bolder;\">Does Instamart.lk Deliver Internationally?</span></h5><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\">Instamart.lk doesn\'t deliver items internationally.</h6><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\">You are more than welcome to make your purchases on our site from anywhere in the world, but you\'ll have to ensure the delivery address is within Sri Lanka.</h6><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 24px;\"><br></span></p><h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><span style=\"font-weight: bolder;\">Can My Order Be Delivered The Same Day I Order?</span></h5><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\">Yes it can. However, this depends on the product ordered and the location for delivery. You can identify such products at checkout.</h6>', 'Shipping & Delivery', NULL, NULL, NULL, '2023-01-19 16:47:28', '2023-01-19 16:48:31'),
(12, 'custom_page', 'Instamart careers', 'careers', '<p><img src=\"https://instamart.lk/public/uploads/all/kHpk9jczHSHGHUP7YYy4OEYOnMAtuNRzRcUKq6H7.png\" style=\"width: 100%;\"><br></p>', NULL, NULL, NULL, NULL, '2023-01-19 18:06:56', '2023-01-19 18:13:15');
