(1, 7, 'Bill Payments', '<p><br></p>', 'en', '2023-01-18 14:20:30', '2023-01-26 18:16:45'),
(2, 8, 'Events Tickets', '<p><img src=\"https://instamart.lk/public/uploads/all/oYt75F7ZpU9LzwTyZpXb4QyXAsIaZ7hlgyEjx0zH.webp\" style=\"width: 100%;\"></p>', 'en', '2023-01-18 17:37:59', '2023-01-18 17:37:59'),
(3, 9, 'Donations', '<p><img src=\"https://instamart.lk/public/uploads/all/fp9dmBLL60AjRPGRSsOUS4L35H4ohLkUzjzpgzK3.webp\" style=\"width: 100%;\"><img src=\"https://instamart.lk/public/uploads/all/93z5GTzHp77bLkNudCZnD8ZLZVpKv2hYribG4OsC.webp\" style=\"width: 100%;\"><br></p>', 'en', '2023-01-18 17:59:17', '2023-01-18 18:00:22'),
(4, 10, 'About INSTAMART.LK', '<h6><img src=\"https://instamart.lk/public/uploads/all/mK9mAg9Pr86xv5DMvDzjxmpkDsjAehqlDGhS9bPo.png\" style=\"width: 50%;\"><br></h6><h6><br></h6><h6>Instamart.lk is 100% Sri Lanka origin largest online Shopping website. We launched in June 2022 and our mission is to become the engine of commerce and trade in Sri Lanka.</h6><h5><span style=\"font-size: 1rem;\">We serve a retail customer base that continues to grow exponentially, offering products that span various categories including Phones, Computers, Clothing, Shoes, Home Appliances, Books, healthcare, Baby Products, personal care and much more.</span><br></h5><h6>Our range of services are designed to ensure optimum levels of convenience and customer satisfaction with the retail process; these services include our lowest price guarantee, 7-day free return policy*, order delivery-tracking, dedicated customer service support and many other premium services.</h6><h6>As we continue to expand the mall, our scope of offerings will increase in variety, simplicity and convenience; join us and enjoy the increasing benefits.</h6><h6>We are highly customer-centric and are committed towards finding innovative ways of improving our customers\' shopping experience with us; so give us some feedback or any press related questions, kindly send us an email on info@instamart.lk.&nbsp;&nbsp;</h6><h5><br></h5><h6>Thank you and we hope you enjoy your experience with us.<br>Best Regards</h6><p><br style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"></p>', 'en', '2023-01-19 16:33:23', '2023-01-19 16:35:43'),
(5, 3, 'Refund and Returns', '<h4 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Overview</span></h4><h4 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><img src=\"https://instamart.lk/public/uploads/all/SxoNRr6quhRdLPe2i8DqN3fO3EC9m8UgMDHpjTUs.webp\" style=\"width: 100%;\"><span style=\"font-weight: bolder;\"><br></span></h4><h3 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><p><a href=\"https://instamart.lk/wp-content/uploads/2022/08/returns.webp\"></a></p></h3><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Our refund and returns policy lasts 7 days. If 7 days have passed since your purchase, we canât offer you a full refund or exchange unless you have warranty on your purchase.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">To be eligible for a return, your item must be unused and in the same condition that you received it. It must also be in the original packaging.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Several types of goods are exempt from being returned. Perishable goods such as food, flowers, newspapers or magazines cannot be returned. We also do not accept products that are intimate or sanitary goods, hazardous materials, or flammable liquids or gases.<br>Additional non-returnable items:</h6><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"></h5><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><ul><li>Gift cards</li></ul><ul><li>Downloadable software products</li></ul><ul><li>Some health and personal care items</li></ul>To complete your return, we require a receipt or proof of purchase.<br>Please do not send your purchase back to the manufacturer.<br>There are certain situations where only partial refunds are granted:</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><ul><li>Book with obvious signs of use</li></ul><ul><li>CD, DVD, VHS tape, software, video game, cassette tape, or vinyl record that has been opened.</li></ul><ul><li>Any item not in its original condition, is damaged or missing parts for reasons not due to our error.</li></ul><ul><li>Any item that is returned more than 30 days after delivery</li></ul></h6><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Refunds</span></h5><h3 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"></h3><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Please contact us via any of our contact channels within seven days of delivery and we will ensure you get resolution.<br>Once your return is received and inspected, we will send you an email to notify you that we have received your returned item. We will also notify you of the approval or rejection of your refund.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><br>If you are approved, then your refund will be processed, and a credit will automatically be applied to your credit card or original method of payment, within a certain amount of days.</h6><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\"><br></span></h5><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Late or missing refunds</span></h5><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">If you havenât received a refund yet, first check your bank account again.<br>Then contact your credit card company, it may take some time before your refund is officially posted.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Next contact your bank. There is often some processing time before a refund is posted.<br>If youâve done all of this and you still have not received your refund yet, please contact us at returns@instamart.lk .</h6><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><br></p><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Sale items</span></h5><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Only regular priced items may be refunded. Sale items cannot be refunded.</h6><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><br></p><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Exchanges</span></h5><h3 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"></h3><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">We only replace items if they are defective or damaged. If you need to exchange it for the same item, send us an email at returns@instamart.lk and send your item to: 192/1A, matagoda road, kerawalapitiya, wattala.</h6><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder; font-size: 1.25rem;\"><br></span></p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder; font-size: 1.25rem;\">Gifts</span><br></p><h3 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"></h3><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">If the item was marked as a gift when purchased and shipped directly to you, youâll receive a gift credit for the value of your return. Once the returned item is received, a gift certificate will be mailed to you.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">If the item wasnât marked as a gift when purchased, or the gift giver had the order shipped to themselves to give to you later, we will send a refund to the gift giver and they will find out about your return.</h6><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><br></p><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Shipping returns</span></h5><h3 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"></h3><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">To return your product, you should mail your product to: 192/1A, matagoda road, kerawalapitiya, wattala.<br>You will be responsible for paying for your own shipping costs for returning your item. Shipping costs are non-refundable. If you receive a refund, the cost of return shipping will be deducted from your refund.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Depending on where you live, the time it may take for your exchanged product to reach you may vary.</h6><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">If you are returning more expensive items, you may consider using a trackable shipping service or purchasing shipping insurance. We donât guarantee that we will receive your returned item.</h6><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><br></p><h5 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"><span style=\"font-weight: bolder;\">Need help?</span></h5><h3 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\"></h3><h6 style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Contact us at returns@instamart.lk for questions related to refunds and returns.</h6>', 'en', '2023-01-19 16:38:49', '2023-01-19 17:12:53'),
(6, 11, 'Shipping & Delivery', '<h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><img src=\"https://instamart.lk/public/uploads/all/PvhMsQQ2CP9YLWig2luGlniMNQdgy8sEZf1XIVNn.jpg\" style=\"width: 100%;\"><span style=\"font-weight: bolder;\"><br></span></h5><h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><span style=\"font-weight: bolder; font-size: 1.25rem;\"><br></span></h5><h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><span style=\"font-weight: bolder; font-size: 1.25rem;\">Are All Items Purchased Online Covered By Warranty?</span><br></h5><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 1rem;\">Products sold directly by instamart.lk are purchased from authorized distributors. Some of the devices are covered under a manufacturer warranty.</span><br></p><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\">We also offer a standard 7 day return policy for eligible items in case you need to make a return.</h6><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\">To return any items bought on instamart.lk, ensure the item is in line with the conditions in the Return Policy.</h6><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><br></p><h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><span style=\"font-weight: bolder;\">How Will The Delivery Be Done?</span></h5><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 1rem;\">We process most of our deliveries through Instamart.lk Delivery Courier. As a marketplace, our featured sellers have the option of making deliveries via other reputable couriers or delivering your order to you themselves.</span><br></p><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 1rem;\"><br></span></p><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 1rem;\">We recommend you pre-pay to instamart.lk (via InstaPay, ATM cards or cash deposit/transfer) for your order in order to take advantage of our Buyer Protection Program.</span><br></p><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 1rem;\"><br></span></p><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 1rem;\">Read more here process most of our deliveries through instamart.lk dispatches.</span><br></p><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><br>Some deliveries may be processed through reputed couriers (there is no added cost to this).</h6><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 24px;\"><br></span></p><h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><span style=\"font-weight: bolder;\">What Is The Estimated Delivery Time?</span></h5><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\">Standard delivery time is 7 days however, this may vary by location and even product.</h6><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><br>Delivery time for products are usually indicated on the product detail page.</h6><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 24px;\"><br></span></p><h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><span style=\"font-weight: bolder;\">Does Instamart.lk Deliver Internationally?</span></h5><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\">Instamart.lk doesn\'t deliver items internationally.</h6><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\">You are more than welcome to make your purchases on our site from anywhere in the world, but you\'ll have to ensure the delivery address is within Sri Lanka.</h6><p style=\"margin-bottom: var(--wd-tags-mb); color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" line-height:=\"\" 1.4;\"=\"\"><span style=\"font-size: 24px;\"><br></span></p><h5 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\"><span style=\"font-weight: bolder;\">Can My Order Be Delivered The Same Day I Order?</span></h5><h6 style=\"margin-bottom: var(--wd-tags-mb); line-height: 1.4; color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" margin-right:=\"\" 0px;=\"\" margin-left:=\"\" padding:=\"\" border:=\"\" vertical-align:=\"\" baseline;=\"\" font-variant-numeric:=\"\" inherit;=\"\" font-variant-east-asian:=\"\" font-stretch:=\"\" inherit;\"=\"\">Yes it can. However, this depends on the product ordered and the location for delivery. You can identify such products at checkout.</h6>', 'en', '2023-01-19 16:47:29', '2023-01-19 16:48:31');
INSERT INTO `page_translations` (`id`, `page_id`, `title`, `content`, `lang`, `created_at`, `updated_at`) VALUES
(7, 5, 'Terms and Conditions', '<p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><img src=\"https://instamart.lk/public/uploads/all/bi4LgR76hFDbHYnoJ8v38JCTFGJTxHsh6rRPsiMV.webp\" style=\"width: 100%;\"><br></p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"></p><h6><b>Please read the Terms and Conditions carefully before using instamart.lk.</b></h6>This document is an electronic record in terms of Electronic Transactions Act. No 19 of 2006 and rules thereunder as applicable and the amended provisions pertaining to electronic records in various statutes as amended by the Electronics Transactions Act No. 19 of 2006.<p></p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">This electronic record is generated by a computer system and does not require any physical or digital signatures.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">1. INTRODUCTION</span><br>Welcome to Instamart.lk also hereby referred as âwe\" or \"us\". We are an online marketplace and these are the terms and conditions governing your access and use of instamart.lk along with its related sub-domains, sites, mobile app, services and tools (the \"Site\"). By using the Site, you hereby accept these terms and conditions (including the linked information herein) and represent that you agree to comply with these terms and conditions (the \"User Agreement\"). This User Agreement is deemed effective upon your use of the Site which signifies your acceptance of these terms. If you do not agree to be bound by this User Agreement please do not access, register with or use this Site. This Site is owned and operated by Instamart groups (Private) Limited.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Instamart groups (PVT) Ltd reserves the right to change, modify, add, or remove portions of these Terms and Conditions at any time without any prior notification. Changes will be effective when posted on the Site with no other notice provided. Please check these Terms and Conditions regularly for updates. Your continued use of the Site following the posting of changes to Terms and Conditions of use constitutes your acceptance of those changes.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">2. CONDITIONS OF USE</span></p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">A. YOUR ACCOUNT</span><br>To access certain services offered by the platform, we may require that you create an account with us or provide personal information to complete the creation of an account. We may at any time in our sole and absolute discretion, invalidate the username and/or password without giving any reason or prior notice and shall not be liable or responsible for any losses suffered by, caused by, arising out of, in connection with or by reason of such request or invalidation.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">You are responsible for maintaining the confidentiality of your user identification, password, account details and related private information. You agree to accept this responsibility and ensure your account and its related details are maintained securely at all times and all necessary steps are taken to prevent misuse of your account. You should inform us immediately if you have any reason to believe that your password has become known to anyone else, or if the password is being, or is likely to be, used in an unauthorized manner. You agree and acknowledge that any use of the Site and related services offered and/or any access to private information, data or communications using your account and password shall be deemed to be either performed by you or authorized by you as the case may be. You agree to be bound by any access of the Site and/or use of any services offered by the Site (whether such access or use are authorized by you or not). You agree that we shall be entitled (but not obliged) to act upon, rely on or hold you solely responsible and liable in respect thereof as if the same were carried out or transmitted by you. You further agree and acknowledge that you shall be bound by and agree to fully indemnify us against any and all losses arising from the use of or access to the Site through your account.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Please ensure that the details you provide us with are correct and complete at all times. You are obligated to update details about your account in real time by accessing your account online. For pieces of information you are not able to update by accessing Your Account on the Site, you must inform us via our customer service communication channels to assist you with these changes. We reserve the right to refuse access to the Site, terminate accounts, remove or edit content at any time without prior notice to you. We may at any time in our sole and absolute discretion, request that you update your Personal Data or forthwith invalidate the account or related details without giving any reason or prior notice and shall not be liable or responsible for any losses suffered by or caused by you or arising out of or in connection with or by reason of such request or invalidation. You hereby agree to change your password from time to time and to keep your account secure and also shall be responsible for the confidentiality of your account and liable for any disclosure or use (whether such use is authorized or not) of the username and/or password.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">&nbsp;</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">B. PRIVACY</span><br>Please review our Privacy Agreement, which also governs your visit to the Site. The personal information / data provided to us by you or your use of the Site will be treated as strictly confidential, in accordance with the Privacy Agreement and applicable laws and regulations. If you object to your information being transferred or used in the manner specified in the Privacy Agreement, please do not use the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">&nbsp;</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">C. PLATFORM FOR COMMUNICATION</span><br>You agree, understand and acknowledge that the Site is an online platform that enables you to purchase products listed at the price indicated therein at any time from any location using a payment method of your choice. You further agree and acknowledge that we are only a facilitator and cannot be a party to or control in any manner any transactions on the Site or on a payment gateway as made available to you by an independent service provider. Accordingly, the contract of sale of products on the Site shall be a strictly bipartite contract between you and the sellers on our Site while the payment processing occurs between you, the service provider and in case of prepayments with electronic cards your issuer bank. Accordingly, the contract of payment on the Site shall be strictly a bipartite contract between you and the service provider as listed on our Site.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">&nbsp;</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">D. CONTINUED AVAILABILITY OF THE SITE</span><br>We will do our utmost to ensure that access to the Site is consistently available and is uninterrupted and error-free. However, due to the nature of the Internet and the nature of the Site, this cannot be guaranteed. Additionally, your access to the Site may also be occasionally suspended or restricted to allow for repairs, maintenance, or the introduction of new facilities or services at any time without prior notice. We will attempt to limit the frequency and duration of any such suspension or restriction.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">&nbsp;</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">E. LICENSE TO ACCESS THE SITE</span><br>We require that by accessing the Site, you confirm that you can form legally binding contracts and therefore you confirm that you are at least 18 years of age or are accessing the Site under the supervision of a parent or legal guardian. We grant you a non-transferable, revocable and non-exclusive license to use the Site, in accordance with the Terms and Conditions described herein, for the purposes of shopping for personal items and services as listed to be sold on the Site. Commercial use or use on behalf of any third party is prohibited, except as explicitly permitted by us in advance. If you are registering as a business entity, you represent that you have the authority to bind that entity to this User Agreement and that you and the business entity will comply with all applicable laws relating to online trading. No person or business entity may register as a member of the Site more than once. Any breach of these Terms and Conditions shall result in the immediate revocation of the license granted in this paragraph without notice to you.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Content provided on this Site is solely for informational purposes. Product representations including price, available stock, features, add-ons and any other details as expressed on this Site are the responsibility of the vendors displaying them and is not guaranteed as completely accurate by us. Submissions or opinions expressed on this Site are those of the individual(s) posting such content and may not reflect our opinions.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We grant you a limited license to access and make personal use of this Site, but not to download (excluding page caches) or modify the Site or any portion of it in any manner. This license does not include any resale or commercial use of this Site or its contents; any collection and use of any product listings, descriptions, or prices; any derivative use of this Site or its contents; any downloading or copying of account information for the benefit of another seller; or any use of data mining, robots, or similar data gathering and extraction tools.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">This Site or any portion of it (including but not limited to any copyrighted material, trademarks, or other proprietary information) may not be reproduced, duplicated, copied, sold, resold, visited, distributed or otherwise exploited for any commercial purpose without express written consent by us as may be applicable.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">You may not frame or use framing techniques to enclose any trademark, logo, or other proprietary information (including images, text, page layout, or form) without our express written consent. You may not use any meta tags or any other text utilizing our name or trademark without our express written consent, as applicable. Any unauthorized use terminates the permission or license granted by us to you for access to the Site with no prior notice. You may not use our logo or other proprietary graphic or trademark as part of an external link for commercial or other purposes without our express written consent, as may be applicable.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">You agree and undertake not to perform restricted activities listed within this section; undertaking these activities will result in an immediate cancellation of your account, services, reviews, orders or any existing incomplete transaction with us and in severe cases may also result in legal action.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Refusal to comply with the Terms and Conditions described herein or any other guidelines and policies related to the use of the Site as available on the Site at all times.<br>Impersonate any person or entity or to falsely state or otherwise misrepresent your affiliation with any person or entity.<br>Use the Site for illegal purposes.<br>Attempt to gain unauthorized access to or otherwise interfere or disrupt other computer systems or networks connected to the Platform or Services.<br>Interfere with anotherâs utilization and enjoyment of the Site;<br>Post, promote or transmit through the Site any prohibited materials as deemed illegal by the laws of Sri Lanka.<br>Use or upload, in any way, any software or material that contains, or which you have reason to suspect that contains, viruses, damaging components, malicious code or harmful components which may impair or corrupt the Siteâs data or damage or interfere with the operation of another Customerâs computer or mobile device or the Site and use the Site other than in conformance with the acceptable use policies of any connected computer networks, any applicable Internet standards and any other applicable laws.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">F. YOUR CONDUCT</span><br>You must not use the website in any way that causes, or is likely to cause, the Site or access to it to be interrupted, damaged or impaired in any way. You must not engage in activities that could harm or potentially harm the Site, its employees, officers, representatives, stakeholders or any other party directly or indirectly associated with the Site or access to it to be interrupted, damaged or impaired in any way. You understand that you, and not us, are responsible for all electronic communications and content sent from your computer to us and you must use the Site for lawful purposes only. You are strictly prohibited from using the Site for;</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">i. fraudulent purposes, or in connection with a criminal offense or other unlawful activity to send, use or reuse any material that does not belong to you; or is illegal, offensive (including but not limited to material that is sexually explicit content or which promotes racism, bigotry, hatred or physical harm), deceptive, misleading, abusive, indecent, harassing, blasphemous, defamatory, libelous, obscene, pornographic, paedophile or menacing; ethnically objectionable, disparaging or in breach of copyright, trademark, confidentiality, privacy or any other proprietary information or right; or is otherwise injurious to third parties; or relates to or promotes money laundering or gambling; or is harmful to minors in any way; or impersonates another person; or threatens the unity, integrity, security or sovereignty of Sri Lanka or friendly relations with foreign States; or objectionable or otherwise unlawful in any manner whatsoever; or which consists of or contains software viruses, political campaigning, commercial solicitation, chain letters, mass mailings or any \"spamâ Use the Site for illegal purposes.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">iii. To cause annoyance, inconvenience or needless anxiety.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">iii. for any other purposes that is other than what is intended by us.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">G. YOUR SUBMISSION</span><br>Anything that you submit to the Site and/or provide to us, including but not limited to, questions, reviews, comments, and suggestions (collectively, \"Submissions\") will become our sole and exclusive property and shall not be returned to you. In addition to the rights applicable to any Submission, when you post comments or reviews to the Site, you also grant us the right to use the name that you submit, in connection with such review, comment, or other content. You shall not use a false e-mail address, pretend to be someone other than yourself or otherwise mislead us or third parties as to the origin of any Submissions. We may, but shall not be obligated to, remove or edit any Submissions without any notice or legal course applicable to us in this regard.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">H. CLAIMS AGAINST OBJECTIONABLE CONTENT</span><br>We list thousands of products for sale offered by numerous sellers on the Site and host multiple comments on listings, it is not possible for us to be aware of the contents of each product listed for sale, or each comment or review that is displayed. Accordingly, we operate on a \"claim, review and takedown\" basis. If you believe that any content on the Site is illegal, offensive (including but not limited to material that is sexually explicit content or which promotes racism, bigotry, hatred or physical harm), deceptive, misleading, abusive, indecent, harassing, blasphemous, defamatory, libellous, obscene, pornographic, paedophilic or menacing; ethnically objectionable, disparaging; or is otherwise injurious to third parties; or relates to or promotes money laundering or gambling; or is harmful to minors in any way; or impersonates another person; or threatens the unity, integrity, security or sovereignty of Sri Lanka or friendly relations with foreign States; or objectionable or otherwise unlawful in any manner whatsoever; or which consists of or contains software viruses, (\" objectionable content \"), please notify us immediately by following by writing to us on admin@instamart.lk We will make all practical endeavors to investigate and remove valid objectionable content complained about within a reasonable amount of time.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Please ensure to provide your name, address, contact information and as many relevant details of the claim including name of objectionable content party, instances of objection, proof of objection amongst other. Please note that providing incomplete details will render your claim invalid and unusable for legal purposes.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">I. CLAIMS AGAINST INFRINGING CONTENT</span><br>We respect the intellectual property of others. If you believe that your intellectual property rights have been used in a way that gives rise to concerns of infringement, please write to us at admin@instamart.lk and we will make all reasonable efforts to address your concern within a reasonable amount of time. Please ensure to provide your name, address, contact information and as many relevant details of the claim including name of infringing party, instances of infringement, proof of infringement amongst other. Please note that providing incomplete details will render your claim invalid and unusable for legal purposes. In addition, providing false or misleading information may be considered a legal offense and may be followed by legal proceedings.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We also respect a manufacturer\'s right to enter into exclusive distribution or resale agreements for its products. However, violations of such agreements do not constitute intellectual property rights infringement. As the enforcement of these agreements is a matter between the manufacturer, distributor and/or respective reseller, it would not be appropriate for us to assist in the enforcement of such activities. While we cannot provide legal advice, nor share private information as protected by the law, we recommend that any questions or concerns regarding your rights may be routed to a legal specialist.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">J. TRADEMARKS AND COPYRIGHTS</span><br>instamart.lk, instamart.lk logo, instamart.lk Fashion, instamart.lk Basics and other marks indicated on our Site are trademarks or registered trademarks in the relevant jurisdiction(s). Our graphics, logos, page headers, button icons, scripts and service names are the trademarks or trade dress and may not be used in connection with any product or service that does not belong to us or in any manner that is likely to cause confusion among customers, or in any manner that disparages or discredits us. All other trademarks that appear on this Site are the property of their respective owners, who may or may not be affiliated with, connected to, or sponsored by us.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">All intellectual property rights, whether registered or unregistered, in the Site, information content on the Site and all the website design, including, but not limited to text, graphics, software, photos, video, music, sound, and their selection and arrangement, and all software compilations, underlying source code and software shall remain our property. The entire contents of the Site also are protected by copyright, trade mark, service mark, patent or other proprietary rights and laws as under applicable laws and international conventions. All rights are reserved.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">K. DISCLAIMER</span><br>You acknowledge and undertake that you are accessing the services on the Site and transacting at your own risk and are using your best and prudent judgment before entering into any transactions through the Site. We shall neither be liable nor responsible for any actions or inactions of sellers nor any breach of conditions, representations or warranties by the sellers or manufacturers of the products and hereby expressly disclaim and any all responsibility and liability in that regard. We shall not mediate or resolve any dispute or disagreement between you and the sellers or manufacturers of the products.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We further expressly disclaim any warranties or representations (express or implied) in respect of quality, suitability, accuracy, reliability, completeness, timeliness, performance, safety, merchantability, fitness for a particular purpose, or legality of the products listed or displayed or transacted or the content (including product or pricing information and/or specifications) on the Site. While we have taken precautions to avoid inaccuracies in content, this Site, all content, information (including the price of products), software, products, services and related graphics are provided as is, without warranty of any kind. We do not implicitly or explicitly support or endorse the sale or purchase of any products on the Site. At no time shall any right, title or interest in the products sold through or displayed on the Site vest with us nor shall instamart.lk have any obligations or liabilities in respect of any transactions on the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We shall neither be liable or responsible for any actions or inactions of any other service provider as listed on our Site which includes but is not limited to payment providers, instalment offerings, warranty services amongst others.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">L. INDEMNITY</span><br>You shall indemnify and hold harmless instamart.lk as owned by Rk groups Private Limited, its subsidiaries, affiliates and their respective officers, directors, agents and employees, from any claim or demand, or actions including reasonable attorney\'s fees, made by any third party or penalty imposed due to or arising out of your breach of these Terms and Conditions or any document incorporated by reference, or your violation of any law, rules, regulations or the rights of a third party.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">You hereby expressly release instamart.lk as owned by Rk groups Private Limited and/or its affiliates and/or any of its officers and representatives from any cost, damage, liability or other consequence of any of the actions/inactions of the sellers or other service providers and specifically waiver any claims or demands that you may have in this behalf under any statute, contract or otherwise. Your only remedy is to discontinue using the Site and its services.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">M. THIRD PARTY BUSINESSES</span><br>Parties other than instamart.lk and its affiliates may operate stores, provide services, or sell product lines on the Site. For example, businesses and individuals offer products via Marketplace. In addition, we provide links to the websites of affiliated companies and certain other businesses. We are not responsible for examining or evaluating, and we do not warrant or endorse the offerings of any of these businesses or individuals, or the content of their websites. We do not assume any responsibility or liability for the actions, products, and content of any of these and any other third-parties. You can tell when a third-party is involved in your transactions by reviewing your transaction carefully, and we may share customer information related to those transactions with that third-party. You should carefully review their privacy statements and related terms and conditions.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">N. COMMUNICATING WITH US</span><br>When you visit the Site, or send e-mails to us, you are communicating with us electronically. You will be required to provide a valid phone number while placing an order with us. We may communicate with you by e-mail, SMS, phone call or by posting notices on the Site or by any other mode of communication we choose to employ. For contractual purposes, you consent to receive communications (including transactional, promotional and/or commercial messages), from us with respect to your use of the website (and/or placement of your order) and agree to treat all modes of communication with the same importance.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">O. LOSSES</span><br>We will not be responsible for any business or personal losses (including but not limited to loss of profits, revenue, contracts, anticipated savings, data, goodwill, or wasted expenditure) or any other indirect or consequential loss that is not reasonably foreseeable to both you and us when you commenced using the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">P. AMENDMENTS TO CONDITIONS OR ALTERATIONS OF SERVICE AND RELATED PROMISE</span><br>We reserve the right to make changes to the Site, its policies, these terms and conditions and any other publicly displayed condition or service promise at any time. You will be subject to the policies and terms and conditions in force at the time you used the Site unless any change to those policies or these conditions is required to be made by law or government authority (in which case it will apply to orders previously placed by you). If any of these conditions is deemed invalid, void, or for any reason unenforceable, that condition will be deemed severable and will not affect the validity and enforceability of any remaining condition.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">Q. EVENTS BEYOND OUR CONTROL</span><br>We will not be held responsible for any delay or failure to comply with our obligations under these conditions if the delay or failure arises from any cause which is beyond our reasonable control. This condition does not affect your statutory rights.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">R. WAIVER</span><br>You acknowledge and recognize that we are a private commercial enterprise and reserve the right to conduct business to achieve our objectives in a manner we deem fit. You also acknowledge that if you breach the conditions stated on our Site and we take no action, we are still entitled to use our rights and remedies in any other situation where you breach these conditions.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">S. TERMINATION</span><br>In addition to any other legal or equitable remedies, we may, without prior notice to you, immediately terminate the Terms and Conditions or revoke any or all of your rights granted under the Terms and Conditions. Upon any termination of this Agreement, you shall immediately cease all access to and use of the Site and we shall, in addition to any other legal or equitable remedies, immediately revoke all password(s) and account identification issued to you and deny your access to and use of this Site in whole or in part. Any termination of this agreement shall not affect the respective rights and obligations (including without limitation, payment obligations) of the parties arising before the date of termination. You furthermore agree that the Site shall not be liable to you or to any other person as a result of any such suspension or termination. If you are dissatisfied with the Site or with any terms, conditions, rules, policies, guidelines, or practices in operating the Site, your sole and exclusive remedy is to discontinue using the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">T. GOVERNING LAW AND JURISDICTION</span><br>These terms and conditions are governed by and construed in accordance with the laws of The Democratic Socialist Republic of Sri Lanka. You agree, as we do, to submit to the exclusive jurisdiction of the courts, of Sri Lanka having jurisdiction over the place on which our Registered Office is situated at the time of institution of legal proceedings.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">U. CONTACT US</span><br>You may reach us here</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">V. OUR SOFTWARE</span><br>Our software includes any software (including any updates or upgrades to the software and any related documentation) that we make available to you from time to time for your use in connection with the Site (the \"Software\").</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">You may use the software solely for purposes of enabling you to use and enjoy our services as permitted by the Terms and Conditions and any related applicable terms as available on the Site. You may not incorporate any portion of the Software into your own programs or compile any portion of it in combination with your own programs, transfer it for use with another service, or sell, rent, lease, lend, loan, distribute or sub-license the Software or otherwise assign any rights to the Software in whole or in part. You may not use the Software for any illegal purpose. We may cease providing you service and we may terminate your right to use the Software at any time. Your rights to use the Software will automatically terminate without notice from us if you fail to comply with any of the Terms and Conditions listed here or across the Site. Additional third-party terms contained within the Site or distributed as such that are specifically identified in related documentation may apply and will govern the use of such software in the event of a conflict with these Terms and Conditions. All software used in any of our services is our property and/or our affiliates or its software suppliers and protected by the laws of Sri Lanka including but not limited to any other applicable copyright laws.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">When you use the Site, you may also be using the services of one or more third parties, such as a wireless carrier or a mobile platform provider. Your use of these third party services may be subject to separate policies, terms of use, and fees of these third parties.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">You may not, and you will not encourage, assist or authorize any other person to copy, modify, reverse engineer, decompile or disassemble, or otherwise tamper with our software whether in whole or in part, or create any derivative works from or of the Software.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">In order to keep the Software up-to-date, we may offer automatic or manual updates at any time and without notice to you.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">3. CONDITIONS OF SALE (BETWEEN SELLERS AND CUSTOMERS)</span><br>Please read these conditions carefully before placing an order for any products with the Sellers on the Site. These conditions signify your agreement to be bound by these conditions.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">A. CONDITIONS RELATED TO SALE OF THE PRODUCT OR SERVICE</span><br>This section deals with conditions relating to the sale of products or services on the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">B. THE CONTRACT</span><br>Your order is a legal offer to the seller to buy the product or service displayed on our Site. When you place an order to purchase a product, any confirmations or status updates received prior to the dispatch of your order serves purely to validate the order details provided and in no way implies the confirmation of the order itself. The acceptance of your order is considered confirmed when the product is dispatched to you. If your order is dispatched in more than one package, you may receive separate dispatch confirmations. Upon time of placing the order, we indicate an approximate timeline that the processing of your order will take however we cannot guarantee this timeline to be rigorously precise in every instance as we are dependent on third party service providers to preserve this commitment. We commit to you to make every reasonable effort to ensure that the indicative timeline is met. All commercial/contractual terms are offered by and agreed to between you and the sellers alone. The commercial/contractual terms include without limitation price, shipping costs, payment methods, payment terms, date, period and mode of delivery, warranties related to products and services and after sales services related to products and services. instamart.lk does not have any control or does not determine or advise or in any way involve itself in the offering or acceptance of such commercial/contractual terms between the you and the Sellers. The seller retains the right to cancel any order at its sole discretion prior to dispatch. We will ensure that there is timely intimation to you of such cancellation via an email or sms. Any prepayments made in case of such cancellation(s), shall be refunded to you within the time frames stipulated here.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">You confirm that the product(s) or service(s) ordered by you are purchased for your internal / personal consumption and not for commercial re-sale. You authorize us to declare and provide declaration to any governmental authority on your behalf stating the aforesaid purpose for your orders on the Site. The Seller or the Site may cancel an order wherein the quantities exceed the typical individual consumption. This applies both to the number of products ordered within a single order and the placing of several orders for the same product where the individual orders comprise a quantity that exceeds the typical individual consumption. What comprises a typical individual\'s consumption quantity limit shall be based on various factors and at the sole discretion of the Seller or ours and may vary from individual to individual.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">You may cancel your order at no cost any time before the item is dispatched to you.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Please note that we sell products only in quantities which correspond to the typical needs of an average household. This applies both to the number of products ordered within a single order and the placing of several orders for the same product where the individual orders comprise a quantity typical for a normal household.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">C. RETURNS</span><br>Please review our Return Policy for details.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">D. PRICING, AVAILABILITY AND ORDER PROCESSING</span><br>All prices are listed in Rupees and are inclusive of all applicable taxes and are listed on the Site by the seller that is selling the product or service (if you need you can convert it to USD in any time with the currency changing option) . Items in your Shopping Cart will always reflect the most recent price displayed on the item\'s product detail page. Please note that this price may differ from the price shown for the item when you first placed it in your cart. Placing an item in your cart does not reserve the price shown at that time. It is also possible that an item\'s price may decrease between the time you place it in your basket and the time you purchase it.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We do not offer price matching for any items sold by any seller on our Site or other websites.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We are determined to provide the most accurate pricing information on the Site to our users; however, errors may still occur, such as cases when the price of an item is not displayed correctly on the Site. As such, we reserve the right to refuse or cancel any order. In the event that an item is mispriced, we may, at our own discretion, either contact you for instructions or cancel your order and notify you of such cancellation. We shall have the right to refuse or cancel any such orders whether or not the order has been confirmed and your prepayment processed. If such a cancellation occurs on your prepaid order, our policies for refund will apply.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We list availability information for products listed on the Site, including on each product information page. Beyond what we say on that page or otherwise on the Site, we cannot be more specific about availability. Please note that dispatch estimates are just that. They are not guaranteed dispatch times and should not be relied upon as such. As we process your order, you will be informed by e-mail or sms if any products you order turn out to be unavailable.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Please note that there are cases when an order cannot be processed for various reasons. The Site reserves the right to refuse or cancel any order for any reason at any given time. You may be asked to provide additional verifications or information, including but not limited to phone number and address, before we accept the order.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">In order to avoid any fraud with credit or debit cards, we reserve the right to obtain validation of your payment details before providing you with the product and to verify the personal information you shared with us. This verification can take the shape of an identity, place of residence, or banking information check. The absence of an answer following such an inquiry will automatically cause the cancellation of the order within a reasonable timeline. We reserve the right to proceed to direct cancellation of an order for which we suspect a risk of fraudulent use of banking instruments or other reasons without prior notice or any subsequent legal liability.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Refund Voucher<br>Refund voucher can be redeemed on our Website, as full or part payment of products from our Website within the given timeline.<br>Refund voucher cannot be used from different account.<br>Vouchers are not replaceable if expired.<br>Promotional Vouchers<br>Each issued promotional voucher (App voucher and New customer voucher) will be valid for use by a customer only once. Multiple usages changing the identity is illegal.<br>Promotional voucher is non-refundable and cannot be exchanged for cash in part or full and is valid for a single transaction only.<br>Promotional voucher may not be valid during sale or in conjunction with any special promotion.<br>Voucher will work only if minimum purchase amount and other conditions are met.<br>instamart.lk reserves the right to vary or terminate the operation of any voucher at any time without notice.<br>instamart.lk shall not be liable to any customer or household for any financial loss arising out of the refusal, cancellation or withdrawal of any voucher or any failure or inability of a customer to use a voucher for any reason.<br>Vouchers are not replaceable if expired.<br>Security and Fraud<br>When you use a voucher, you warrant to instamart.lk that you are the duly authorized recipient of the voucher and that you are using it in good faith.<br>If you redeem, attempt to redeem or encourage the redemption of voucher to obtain discounts to which you are not entitled you may be committing a civil or criminal offence.<br>If we reasonably believe that any voucher is being used unlawfully or illegally we may reject or cancel any voucher/order and you agree that you will have no claim against us in respect of any rejection or cancellation. instamart.lk reserves the right to take any further action it deems appropriate in such instances</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">E. RESELLING DARAZ PRODUCTS</span><br>Reselling instamart.lk products for business purpose is strictly prohibited. If any unauthorized personnel is found committing the above act, legal action may be taken against him/her.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">F. TAXES</span><br>You shall be responsible for payment of all fees/costs/charges associated with the purchase of products from the Site and you agree to bear any and all applicable taxes as per prevailing law.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\"><span style=\"font-weight: bolder;\">l. REPRESENTATIONS AND WARRANTIES</span><br>We do not make any representation or warranty as to specifics (such as quality, value, saleability, etc) of the products or services listed to be sold on the Site when products or services are sold by third parties. We do not implicitly or explicitly support or endorse the sale or purchase of any products or services on the Site. We accept no liability for any errors or omissions, whether on behalf of itself or third parties.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We are not responsible for any non-performance or breach of any contract entered into between you and the sellers. We cannot and do not guarantee your actions or those of the sellers as they conclude transactions on the Site. We are not required to mediate or resolve any dispute or disagreement arising from transactions occurring on our Site.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">We do not at any point of time during any transaction as entered into by you with a third party on our Site, gain title to or have any rights or claims over the products or services offered by a seller. Therefore, we do not have any obligations or liabilities in respect of such contract(s) entered into between you and the seller(s). We are not responsible for unsatisfactory or delayed performance of services or damages or delays as a result of products which are out of stock, unavailable or back ordered.</p><p style=\"color: rgb(27, 27, 40); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Pricing on any product(s) or related information as reflected on the Site may due to some technical issue, typographical error or other reason by incorrect as published and as a result you accept that in such conditions the seller or the Site may cancel your order without prior notice or any liability arising as a result. Any prepayments made for such orders will be refunded to you per our refund policy as stipulated.</p>', 'en', '2023-01-19 17:33:01', '2023-01-19 17:56:15');
INSERT INTO `page_translations` (`id`, `page_id`, `title`, `content`, `lang`, `created_at`, `updated_at`) VALUES
(8, 6, 'Privacy Policy Page', '<p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><img src=\"https://instamart.lk/public/uploads/all/WWzglJUKPOPypXIiBb7w1nGMkwKTeYsi8Q3KI8Xy.webp\" style=\"width: 100%;\"><br></p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">Welcome to the instamart.lk website (the \"Site\") operated by instamart groups (Private) Limited, We respect your privacy and want to protect your personal information. To learn more, please read this Privacy Policy.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">1.</span>This Privacy Policy explains how we collect, use and (under certain conditions) disclose your personal information. This Privacy Policy also explains the steps we have taken to secure your personal information. Finally, this Privacy Policy explains your options regarding the collection, use and disclosure of your personal information. By visiting the Site directly or through another site, you accept the practices described in this Policy.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">2.</span>Data protection is a matter of trust and your privacy is important to us. We shall therefore only use your name and other information which relates to you in the manner set out in this Privacy Policy. We will only collect information where it is necessary for us to do so and we will only collect information if it is relevant to our dealings with you.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">3.</span>We will only keep your information for as long as we are either required to by law or as is relevant for the purposes for which it was collected.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">4.</span>We will cease to retain your personal data, or remove the means by which the data can be associated with you, as soon as it is reasonable to assume that such retention no longer serves the purposes for which the personal data was collected, and is no longer necessary for any legal or business purpose.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">5.</span>You can visit the Site and browse without having to provide personal details. During your visit to the Site you remain anonymous and at no time can we identify you unless you have an account on the Site and log on with your user name and password.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.</span>Data that we collect</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.1</span>We may collect various pieces of information if you seek to place an order for a product with us on the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.2</span>We collect, store and process your data for processing your purchase on the Site and any possible later claims, and to provide you with our services. We may collect personal information including, but not limited to, your title, name, gender, date of birth, email address, postal address, delivery address (if different), telephone number, mobile number, fax number, payment details, payment card details or bank account details.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.2.1</span>Instamart.lk shall collect the following information where you are a buyer:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">i.</span>&nbsp;Identity data, such as your name, gender, profile picture, and date of birth;&nbsp;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">ii.</span>&nbsp;Contact data, such as billing address, delivery address/location, email address and phone numbers;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">iii.</span>&nbsp;Biometric data, such as voice files and face recognition when you use our voice search function, and your facial features of when you use the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">iv.</span>&nbsp;Billing account information: bank account details, credit card account and payment information (such account data may also be collected directly by our affiliates&nbsp;&nbsp;and/or third party payment service providers);</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">v.</span>&nbsp;Transaction records/data, such as details about orders and payments, user clicks, and other details of products and Services related to you;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">vi.</span>&nbsp;Technical data, such as Internet protocol (IP) address, your login data, browser type and version, time zone setting and location, device information, browser plug-in&nbsp;&nbsp;type and versions, operating system and platform, international mobile equipment identity, device identifier, IMEI, MAC address, cookies (where applicable) and other information and technology on the devices you use to access the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">vii.</span>&nbsp;Profile data, such as your username and password, account settings, orders related to you, user research, your interests, preferences, feedback and survey responses;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">viii.</span>&nbsp;Usage data, such as information on how you use the Site, products and Services or view any content on the Site, including the time spent on the Site, items and data searched for on the Site, access times and dates, as well as websites you were visiting before you came to the Site and other similar statistics;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">ix.</span>&nbsp;Location data, such as when you capture and share your location with us in the form of photographs or videos and upload such content to the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">x.</span>&nbsp;Marketing and communications data, such as your preferences in receiving marketing from us and our third parties, your communication preferences and your chat, email or call history on the Site or with third party customer service providers; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">xi.</span>&nbsp;Additional information we may request you to submit for due diligence checks or required by relevant authorities as required for identity verification (such as copies of government issued identification, e.g. passport, ID cards, etc.) or if we believe you are violating our Privacy Policy or our Customer Terms and Conditions.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.2.2.</span>Instamart.lk shall collect the following information where you are a seller:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">i.</span>&nbsp;Identity and contact data, such as your name, date of birth or incorporation, company name, address, email address, phone number and other business-related information (e.g. company registration number, business license, tax information, shareholder and director information, etc.);</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">ii.</span>&nbsp;Account data, such as bank account details, bank statements, credit card details and payment details (such account data may also be collected directly by our affiliates and/or third party payment service providers);</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">iii.</span>&nbsp;Transaction data, such as details about orders and payments, and other details of products and Services related to you;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">iv.</span>&nbsp;Technical data, such as Internet protocol (IP) address, your login data, browser type and version, time zone setting and location, browser plug-in types and versions, operating system and platform, international mobile equipment identity, device identifier, IMEI, MAC address, cookies (where applicable) and other information and technology on the devices you use to access the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">v.</span>&nbsp;Profile data, such as your username and password, orders related to you, your interests, preferences, feedback and survey responses;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">vi.</span>&nbsp;Usage data, such as information on how you use the Site, products and Services or view any content on the Site, including the time spent on the Site, items and data searched for on the Site, access times and dates, as well as websites you were visiting before you came to the Site and other similar statistics;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">vii.</span>&nbsp;Location data, such as when you capture and share your location with us in the form of photographs or videos and upload such content to the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">viii.</span>&nbsp;Marketing and communications data, such as your preferences in receiving marketing from us and our third parties and your communication preferences and your chat, email or call history on the Site or with our third party seller service providers; and&nbsp;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">ix.</span>&nbsp;Additional information we may request you to submit for authentication (such as copies of government issued identification, e.g. passport, ID cards, etc.) or if we believe you are violating our Privacy Policy or our Terms of Use.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.</span>We will use the information you provide to enable us to process your orders and to provide you with the services and information offered through our website and which you request in the following ways:.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.1</span>.If you are a buyer:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.1.1.</span>Processing your orders for products:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. Process orders you submit through the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. Deliver the products you have purchased through the Site for which we may pass your personal information on to a third party (e.g. our logistics partner) in order to make delivery of the product to you;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. Update you on the delivery of the products;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iv. Provide customer support for your orders;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">v. Verify and carry out payment transactions (including any credit card payments, bank transfers, offline payments, remittances, or e-wallet transactions) in relation to payments related to you and/or services used by you. In order to verify and carry out such payment transactions, payment information, which may include personal data, will be transferred to third parties such as our payment service providers;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.1.2.</span>&nbsp;Providing services</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. Facilitate your use of the services or access to the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. Administer your account with us;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. Display your name, username or profile on the Site (including on any reviews you may post);</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iv. Respond to your queries, feedback, claims or disputes, whether directly or through our third party service providers; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">v. Display on scoreboards on the Site in relation to campaigns, mobile games or any other activity;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.1.3.</span>&nbsp;Marketing and advertising:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. Provide you with information we think you may find useful or which you have requested from us (provided you have opted to receive such information);</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. Send you marketing or promotional information about \\ products and services on the Site from time to time (provided you have opted to receive such information); and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. Help us conduct marketing and advertising;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.1.4.</span>&nbsp;Legal and operational purposes:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. Ascertain your identity in connection with fraud detection purposes;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. Compare information, and verify with third parties in order to ensure that the information is accurate;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. Process any complaints, feedback, enforcement action you may have lodged with us;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iv. Produce statistics and research for internal and statutory reporting and/or record-keeping requirements;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">v. Store, host, back up your personal data;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vi. Prevent or investigate any actual or suspected violations of our Terms of Use, Privacy Policy, fraud, unlawful activity, omission or misconduct, whether relating to your use of Site or any other matter arising from your relationship with us;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vii. Perform due diligence checks;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">viii. Comply with legal and regulatory requirements (including, where applicable, the display of your name, contact details and company details), including any law enforcement requests, in connection with any legal proceedings, or otherwise deemed necessary by us; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ix. Where necessary to prevent a threat to life, health or safety.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.1.5.</span>&nbsp;Analytics, research, business and development:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. Understand your user experience on the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. Improve the layout or content of the pages of the Site and customize them for users;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. Identify visitors on the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iv. Conduct surveys, including carrying out research on our usersâ demographics and behavior;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">v. Derive further attributes relating to you based on personal data provided by you (whether to us or third parties), in order to provide you with more targeted and/or relevant information;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vi. Conduct data analysis, testing and research, monitoring and analyzing usage and activity trends;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vii. Further develop our products and services; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.1.6.</span>&nbsp;Other</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. Any other purpose to which your consent has been obtained; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. Conduct automated decision-making processes in accordance with any of the above purposes.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.2.</span>&nbsp;If you are a seller:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.2.1.</span>&nbsp;Providing Services</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. To facilitate your use of the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. To ship or deliver the products you have listed or sold through the Site. We may pass your personal information on to a third party (e.g. our logistics partners) or relevant regulatory authority (e.g. customs) in order to carry out shipping or delivery of the products listed or sold by you;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. To respond to your queries, feedback, claims or disputes, whether directly or through our third party service agents;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iv. To verify your documentation submitted to us facilitate your onboarding with us as a seller on the Site, including the testing of technologies to enable faster and more efficient onboarding;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">v. To administer your account (if any) with us;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vi. To display your name, username or profile on the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vii. To verify and carry out financial transactions (including any credit card payments, bank transfers, offline payments, remittances, or e-wallet transactions) in relation to payments related to you and/or Services used by you. In order to verify and carry out such payment transactions, payment information, which may include personal data, will be transferred to third parties such as our payment service providers;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">viii. To assess your application for loan facilities and/or to perform credit risk assessments in relation to your application for seller financing (where applicable);</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ix. To provide you with ancillary logistics services to protect against risks of failed deliveries or customer returns; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">x. To facilitate the return of products to you (which may be through our logistics partner).</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.2.2.</span>&nbsp;Marketing and advertising</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. To send you marketing or promotional materials about our or third-party sellersâ products and services on our Site from time to time (provided you have opted to receive such information); and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. To help us conduct marketing and advertising.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.2.3.</span>&nbsp;Legal and operational purposes</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. To produce statistics and research for internal and statutory reporting and/or record-keeping requirements;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. To store, host, back up your personal data;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. To prevent or investigate any actual or suspected violations of our Terms of Use, Privacy Policy, fraud, unlawful activity, omission or misconduct, whether relating to your use of our Services or any other matter arising from your relationship with us;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iv. To comply with legal and regulatory requirements (including, where applicable, the display of your name, contact details and company details), including any law enforcement requests, in connection with any legal proceedings or otherwise deemed necessary by us;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">v. Where necessary to prevent a threat to life, health or safety;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vi. To process any complaints, feedback, enforcement action and take-down requests in relation to any content you have uploaded to the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vii. To compare information, and verify with third parties in order to ensure that the information is accurate;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">viii. To ascertain your identity in connection with fraud detection purposes; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ix. To facilitate the takedown of prohibited and controlled items from our Site.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.2.4.</span>&nbsp;Analytics, research, business and development</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. To audit the downloading of data from the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. To understand the user experience with the Services and the Site;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. To improve the layout or content of the pages of the Site and customize them for users;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iv. To conduct surveys, including carrying out research on our usersâ demographics and behavior to improve our current technology (e.g. voice recognition tech, etc.) via machine learning or other means;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">v. To derive further attributes relating to you based on personal data provided by you (whether to us or third parties), in order to provide you with more targeted and/or relevant information;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vi. To conduct data analysis, testing and research, monitoring and analyzing usage and activity trends;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">vii. To further develop our products and services; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">viii. To know our sellers better.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.3.2.5.</span>&nbsp;Other</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. Any other purpose to which your consent has been obtained; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. To conduct automated decision-making processes in accordance with any of these purposes.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.4.</span>&nbsp;Further, we will use the information you provide to administer your account with us; verify and carry out financial transactions in relation to payments you make; audit the downloading of data from our website; improve the layout and/or content of the pages of our website and customize them for users; identify visitors on our website; carry out research on our users\' demographics; send you information we think you may find useful or which you have requested from us, including information about our products and services, provided you have indicated that you have not objected to being contacted for these purposes.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.5.</span>&nbsp;Subject to obtaining your consent we may contact you by email with details of other products and services. You may unsubscribe from receiving marketing information at any time in our mobile application settings or by using the unsubscribe function within the electronic marketing material. We may use your contact information to send newsletters from us and from our related companies. If you prefer not to receive any marketing communications from us, you can opt out at any time.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.6.</span>&nbsp;We may pass your name and address on to a third party in order to make delivery of the product to you (for example to our courier or supplier). You must only submit to us the Site information which is accurate and not misleading and you must keep it up to date and are responsible for informing us of changes to your personal data, or in the event you believe that the personal data we have about you is inaccurate, incomplete, misleading or out of date. Inform us of changes. You can update your personal data anytime by accessing your account on the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">6.7.</span>&nbsp;Your actual order details may be stored with us but for security reasons cannot be retrieved directly by us. However, you may access this information by logging into your account on the Site. Here you can view the details of your orders that have been completed, those which are open and those which are shortly to be dispatched and administer your address details, bank details ( for refund purposes) and any newsletter to which you may have subscribed. You undertake to treat the personal access data confidentially and not make it available to unauthorized third parties. We cannot assume any liability for misuse of passwords unless this misuse is our fault.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">7.&nbsp;</span>Other uses of your Personal Information</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">7.1.</span>&nbsp;We may use your personal information for opinion and market research. Your details are anonymous and will only be used for statistical purposes. You can choose to opt out of this at any time. Any answers to surveys or opinion polls we may ask you to complete will not be forwarded on to third parties. Disclosing your email address is only necessary if you would like to take part in competitions. We save the answers to our surveys separately from your email address.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">7.2.</span>&nbsp;We may also send you other information about us, the Site, our other websites, our products, sales promotions, our newsletters, anything relating to other companies in our group or our business partners. If you would prefer not to receive any of this additional information as detailed in this paragraph (or any part of it) please click the \'unsubscribe\' link in any email that we send to you. Within 7 working days (days which are neither (i) a Sunday, nor (ii) a public holiday anywhere in Sri Lanka) of receipt of your instruction we will cease to send you information as requested. If your instruction is unclear we will contact you for clarification.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">7.3.</span>&nbsp;We may further anonymize data about users of the Site generally and use it for various purposes, including ascertaining the general location of the users and usage of certain aspects of the Site or a link contained in an email to those registered to receive them, and supplying that anonymized data to third parties such as publishers. However, that anonymized data will not be capable of identifying you personally.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">8.</span>&nbsp;Competitions</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">8.1.</span>&nbsp;For any competition we use the data to notify winners and advertise our offers. You can find more details where applicable in our participation terms for the respective competition.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.</span>&nbsp;Third Parties and Links</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.1.</span>&nbsp;We may pass your details to other companies in our group. We may also pass your details to our agents and subcontractors to help us with any of our uses of your data set out in our Privacy Policy. For example, we may use third parties to assist us with delivering products to you, to help us to collect payments from you, to analyze data and to provide us with marketing or customer service assistance. We may also exchange information with third parties for the purposes of fraud protection and credit risk reduction.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.2.</span>&nbsp;We may share (or permit the sharing of) your personal data with and/or transfer your personal data to third parties and/or our affiliates for the above-mentioned purposes. These third parties and affiliates, which may be located inside or outside your jurisdiction, include but are not limited to:</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">i. Service providers (such as agents, vendors, contractors and partners) in areas such as payment services, logistics and shipping, marketing, data analytics, market or consumer research, survey, social media, customer service, installation services, information technology and website hosting;</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">ii. Their service providers and related companies; and</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">iii. Other users of the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.3.</span>&nbsp;We may transfer our databases containing your personal information if we sell our business or part of it, provided that we satisfy the requirements of applicable data protection law when disclosing your personal data. Other than as set out in this Privacy Policy, we shall NOT sell or disclose your personal data to third parties without obtaining your prior consent unless this is necessary for the purposes set out in this Privacy Policy or unless we are required to do so by law. The Site may contain advertising of third parties and links to other sites or frames of other sites. Please be aware that we are not responsible for the privacy practices or content of those third parties or other sites, nor for any third party to whom we transfer your data in accordance with our Privacy Policy. You are advised to check on the applicable privacy policies of those websites to determine how they will handle any information they collect from you.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.4.</span>&nbsp;In disclosing your personal data to third parties, we endeavor to ensure that the third parties and our affiliates keep your personal data secure from unauthorized access, collection, use, disclosure, processing or similar risks and retain your personal data only for as long as your personal data helps with any of the uses of your data as set out in our Privacy Policy.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.5.</span>&nbsp;We may transfer or permit the transfer of your personal data outside of Sri Lanka for any of the purposes set out in this Privacy Policy. However, we will not transfer or permit any of your personal data to be transferred outside of Sri Lanka unless the transfer is in compliance with applicable laws and this Privacy Policy.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">9.6.</span>&nbsp;We may share your personal data with our third party service providers or affiliates (e.g. payment service providers) in order for them to offer services to you other than those related to your use of the Site. Your acceptance and use of the third party service providerâs or our affiliateâs services shall be subject to terms and conditions as may be agreed between you and the third party service provider or our affiliate. Upon your acceptance of the third party service providerâs or our affiliateâs service offering, the collection, use, disclosure, storage, transfer and processing of your data (including your personal data and any data disclosed by us to such third party service provider or affiliate) shall be subject to the applicable privacy policy of the third party service provider or our affiliate, which shall be the data controller of such data. You agree that any queries or complaints relating to your acceptance or use of the third party service providerâs or our affiliateâs services shall be directed to the party named in the applicable privacy policy.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">10.</span>&nbsp;Cookies</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">10.1.</span>&nbsp;We or our authorized service providers may use cookies, web beacons, and other similar technologies in connection with your use of the Site.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">10.2.</span>&nbsp;The acceptance of cookies is not a requirement for visiting the Site. However, we would like to point out that the use of the \'basket\' functionality on the Site and ordering is only possible with the activation of cookies. Cookies are small text files (typically made up of letters and numbers) placed in the memory of your browser or device when you visit a website or view a message. They allow us to recognize a particular device or browser. Web beacons are small graphic images that may be included on the Site. They allow us to count users who have viewed these pages so that we can better understand your preference and interests. Cookies are tiny text files which identify your computer to our server as a unique user when you visit certain pages on the Site and they are stored by your Internet browser on your computer\'s hard drive. Cookies can be used to recognize your Internet Protocol address, saving you time while you are on, or want to enter, the Site. We only use cookies for your convenience in using the Site (for example to remember who you are when you want to amend your shopping cart without having to re-enter your email address) and not for obtaining or using any other information about you (for example targeted advertising). However, certain cookies are required to enable core functionality (such as adding items to your shopping basket), so please note that changing and deleting cookies may affect the functionality available on the Sit. Your browser can be set to not accept cookies, but this would restrict your use of the Site. Please accept our assurance that our use of cookies does not contain any personal or private details and are free from viruses. If you want to find out more information about cookies, go to&nbsp;<a href=\"https://policies.google.com/technologies/cookies?hl=en-US\">all-about-cookies</a>&nbsp;or to find out about removing them from your browser, go to&nbsp;<a href=\"chrome://settings/cookies\">here</a>.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">10.3.</span>&nbsp;This website uses Google Analytics, a web analytics service provided by Google, Inc. (\"Google\"). Google Analytics uses cookies, which are text files placed on your computer, to help the website analyze how users use the site. The information generated by the cookie about your use of the website (including your IP address) will be transmitted to and stored by Google on servers in the United States. Google will use this information for the purpose of evaluating your use of the website, compiling reports on website activity for website operators and providing other services relating to website activity and internet usage. Google may also transfer this information to third parties where required to do so by law, or where such third parties process the information on Google\'s behalf. Google will not associate your IP address with any other data held by Google. You may refuse the use of cookies by selecting the appropriate settings on your browser, however please note that if you do this you may not be able to use the full functionality of this website. By using this website, you consent to the processing of data about you by Google in the manner and for the purposes set out above.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">11.</span>&nbsp;Security</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">11.1.</span>&nbsp;We have in place appropriate technical and security measures to prevent unauthorized or unlawful access to or accidental loss of or destruction or damage to your information. When we collect data through the Site, we collect your personal details on a secure server. We use firewalls on our servers. Our security procedures mean that we may occasionally request proof of identity before we disclose personal information to you. You are responsible for protecting against unauthorized access to your password and to your computer.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">11.2.</span>&nbsp;You should be aware, however, that no method of transmission over the Internet or method of electronic storage is completely secure. While security cannot be guaranteed, we strive to protect the security of your information and are constantly reviewing and enhancing our information security measures.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">12.</span>&nbsp;Your rights</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">12.1.</span>&nbsp;If you are concerned about your data, you have the right to request access to the personal data which we may hold or process about you. You have the right to require us to correct any inaccuracies in your data free of charge. At any stage you also have the right to ask us to stop using your personal data for direct marketing purposes.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">Where permitted by applicable data protection laws, we reserve the right to charge a reasonable administrative fee for retrieving your personal data records. If so, we will inform you of the fee before processing your request.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">You may communicate the withdrawal of your consent to the continued use, disclosure, storing and/or processing of your personal data by contacting our customer services, subject to the conditions and/or limitations imposed by applicable laws or regulations. Please note that if you communicate your withdrawal of your consent to our use, disclosure, storing or processing of your personal data for the purposes and in the manner as stated above or exercise your other rights as available under applicable local laws, we may not be in a position to continue to provide the Services to you or perform any contract we have with you, and we will not be liable in the event that we do not continue to provide the Services to, or perform our contract with you. Our legal rights and remedies are expressly reserved in such an event.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\">Furthermore, you also have the right to ask us to delete your data. If you would like to have your data deleted, fill out the&nbsp;<a href=\"https://active.instamart.lk/privacy-policy#\">Account Deactivation/Deletion Request Form</a>&nbsp;(âDeletion Requestâ) or email your request to&nbsp;info@instamart.lk. Once your request is received, we follow an internal deletion process to make sure that your data is safely removed in the next fifteen (15) working days. You\'ll be contacted for verification and your account will be deleted after necessary protocols are conformed to. Read more about the deletion process&nbsp;<a href=\"https://active.instamart.lk/privacy-policy#\">here</a>.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">13.</span>&nbsp;Minors</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">13.1.</span>&nbsp;We do not sell products to minors, i.e. individuals below the age of 18, on the Site and we do not knowingly collect any personal data relating to minors. You hereby confirm and warrant that you are above the age of 18 and are capable of understanding and accepting the terms of this Privacy Policy.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">13.2.</span>&nbsp;If you allow a minor to access the Site and buy products from the Site by using your account, you hereby consent to the processing of the minorâs personal data and accept and agree to be bound by this Privacy Policy and take responsibility for his or her actions.</p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"></p><p style=\"color: rgb(27, 27, 40); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">13.3.</span>&nbsp;We will not be responsible for any unauthorized use of your account on the Site by yourself, users who act on your behalf or any unauthorized users. It is your responsibility to make your own informed decisions about the use of the Site and take necessary steps to prevent any misuse of the Site.</p>', 'en', '2023-01-19 17:48:10', '2023-01-19 17:48:10'),
(9, 12, 'Instamart careers', '<p><img src=\"https://instamart.lk/public/uploads/all/kHpk9jczHSHGHUP7YYy4OEYOnMAtuNRzRcUKq6H7.png\" style=\"width: 100%;\"><br></p>', 'en', '2023-01-19 18:06:56', '2023-01-19 18:13:15');
